s["_1"]="Title¬RPN Schema,Content¬RPN Schema   Elements ElementDescription LookupRPNRequestEmployer's Lookup RPN Request. LookupRPNResponseEmployer's Lookup RPN Response. Will either return RPN detail or details of validation errors. NewRPNRequestRequest for RPN details for new employee(s). NewRPNResponseEmployer's New RPN Response. Will either return RPN detail or details of validation errors.  Complex Types Complex TypeDescription EmployeeIDUnique references to an employment for an employee. Includes EmployeePPSN and Employment ID. ErrorStandard Validation error. LookupRPNRequestEmployer's Lookup RPN Request. LookupRPNResponseEmployer's Lookup RPN Response. Will either return RPN detail or details of validation errors. NameEmployee Name. NewEmployeeDetailDetails of employees who require a new RPN. NewRPNRequestRequest for RPN details for new employee(s). NewRPNResponseEmployer's New RPN Response. Will either return RPN detail or details of validation errors. RangeParametersThe range of RPN to be retrieved. RPNRevenue Payroll Notification (RPN) for an employment for an employee SoftwareUsedReferences to third party software used. TaxRateDetails of Tax Rates and Rate Cut Offs USCRateDetails of USC Rate."
s["_2"]="Title¬Payroll Schema,Content¬Payroll Schema   Elements ElementDescription CheckPayrollRunRequestRequest to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. CheckPayrollRunResponseReturn the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. CheckPayrollSubmissionRequestRequest to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. CheckPayrollSubmissionResponseReturn the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. PayrollSubmissionRequestEmployer's PAYE Payroll Submission Request. PayrollSubmissionResponseAcknowledges the receipt of an Employer's PAYE Payroll Submission Request, or Validation Errors if validation failed.  Complex Types Complex TypeDescription AddressEmployee Address. The address of the employee. This will be Mandatory if the PPSN isn’t available. BatchReferenceReferences used for batching of a submission into multiple submissions BatchStatusStatus of each batch for a submission recieved in multiple batches. CheckPayrollRunRequestRequest to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. CheckPayrollRunResponseReturn the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. CheckPayrollSubmissionRequestRequest to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. CheckPayrollSubmissionResponseReturn the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. EmployeeIDUnique references to an employment for an employee. Includes PPSN and Employment ID. ErrorDetails of validation check failure. InvalidPayslipDetail of Invalid Payslips.  NameEmployee Name. OtherPaymentsOther payments, payment code and payment value. PayrollSubmissionRequestEmployer's PAYE Payroll Submission Request. PayrollSubmissionResponseAcknowledges the receipt of an Employer's PAYE Payroll Submission Request, or Validation Errors if validation failed. PayslipIndividual payslip details for employer's Payroll submission. PayslipSummarySummary totals for an individual payslip in a Payroll Submission or Payroll Run. PayslipWarningValidation error identifed at Payslip/Line Item Level. PRSIClassDetailPRSI Class, subclass and Insurable weeks detail. SoftwareUsedThird party software product identifier. SubmissionHeaderRequired header level elements for a payroll submission. SubmissionStatusHigh Level details of the Payroll Submissions that make up the Payroll Run. SubmissionSummarySummary totals and count accross valid line items for a Payroll Submission or Payroll Run. TaxRateDetail of Rate Cut Off. WarningDetails of validation check warning.  Simple Types Simple TypeDescription directorTypeThis should be included at the start of a director's employment or if there is any change payFrequencyIndicates the frequency of the employees payments. paymentCodeDescription of other payment."
