s["_106"]="Title¬PayForIncomeTaxToDate Element,Content¬PayForIncomeTaxToDate Element    > RPN Complex Type : PayForIncomeTaxToDate Element  Description Data Item Ref: 116. Total Pay for Income Tax to Date. This will include total income liable to Income Tax to date – including previous employment income. In the case of recommencements, this includes previous pay from that employer in the same tax year. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/rpn/  Type defaultDecimal Simple Type Diagram   Overview PayForIncomeTaxToDate defaultDecimal Simple Type  Data Item Ref: 116. Total Pay for Income Tax to Date. This will include total income liable to Income Tax to date – including previous employment income. In the case of recommencements, this includes previous pay from that employer in the same tax year.  Source <xs:element name=PayForIncomeTaxToDate type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 116. Total Pay for Income Tax to Date. This will include total income liable to Income Tax to date – including previous employment income. In the case of recommencements, this includes previous pay from that employer in the same tax year.</xs:documentation>   </xs:annotation> </xs:element>  See Also RPN Complex Type |"
