s["_123"]="Title¬CheckPayrollRunRequest Element,Content¬CheckPayrollRunRequest Element    : CheckPayrollRunRequest Element  Description Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type CheckPayrollRunRequest Complex Type Diagram   Overview CheckPayrollRunRequest CheckPayrollRunRequest Complex Type  Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. Sequence  EmployerRegistrationNumber employerReg Simple Type  Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Tax Advisor Identification Number. Required if payroll submission is filed by an agent on behalf of employer. TaxYear dateYear Simple Type  Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.   PayrollRunReference PayrollRunReference Simple Type  Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’.    Source <xs:element name=CheckPayrollRunRequest type=pp:CheckPayrollRunRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_124"]="Title¬CheckPayrollRunResponse Element,Content¬CheckPayrollRunResponse Element    : CheckPayrollRunResponse Element  Description Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type CheckPayrollRunResponse Complex Type Diagram   Overview CheckPayrollRunResponse CheckPayrollRunResponse Complex Type  Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. Sequence  Status processingStatus Simple Type  Current Status of Payroll Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the Payroll Run are at a status of Pending. TaxOnIncome optional xs:decimal  Total Tax on Income amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. PRSI optional xs:decimal  Total PRSI amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. USC optional xs:decimal  Total USC amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. LPT optional xs:decimal  Total LPT amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. Submission 0..∞ SubmissionStatus Complex Type  High Level details of the Payroll Submissions that make up the Payroll Run. Sequence  SubmissionID submissionID Simple Type  Unique ID of the Payroll Submission. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. SubmissionSummary optional SubmissionSummary Complex Type  Summary details of submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.     PayslipSummary 0..∞ PayslipSummary Complex Type  Summary details of individual payslips that make up the Payroll Run. Sequence  LineItemID payrollRunLineItemID Simple Type  Data Item Ref: N/A. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 8. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 14. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 13. Employee's internal staff identifier/reference. This will be Mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. TaxOnIncome xs:decimal  Total Tax on Income for this payslip on submission. PRSI xs:decimal  Total PRSI amount for this payslip on submission. USC xs:decimal  Total USC amount for this payslip on submission. LPT xs:decimal  Total LPT amount for this payslip on submission.   ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckPayrollRunRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Source <xs:element name=CheckPayrollRunResponse type=pp:CheckPayrollRunResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_125"]="Title¬CheckPayrollSubmissionRequest Element,Content¬CheckPayrollSubmissionRequest Element    : CheckPayrollSubmissionRequest Element  Description Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type CheckPayrollSubmissionRequest Complex Type Diagram   Overview CheckPayrollSubmissionRequest CheckPayrollSubmissionRequest Complex Type  Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. Sequence  EmployerRegistrationNumber employerReg Simple Type  Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Tax Advisor Identification Number. Required if payroll submission filed by agent on behalf of employer. TaxYear dateYear Simple Type  Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.   PayrollRunReference PayrollRunReference Simple Type  Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. SubmissionID submissionID Simple Type  Unique Submission ID of the Employer Payroll Submission. Used to identify individual submissions.    Source <xs:element name=CheckPayrollSubmissionRequest type=pp:CheckPayrollSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_126"]="Title¬CheckPayrollSubmissionResponse Element,Content¬CheckPayrollSubmissionResponse Element    : CheckPayrollSubmissionResponse Element  Description Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type CheckPayrollSubmissionResponse Complex Type Diagram   Overview CheckPayrollSubmissionResponse CheckPayrollSubmissionResponse Complex Type  Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. Sequence  SubmissionID submissionID Simple Type  Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. For batch submissions, all submissions should have the same SubmissionID and should have the BatchID and BatchCount populated. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. BatchCount optional xs:unsignedShort  Total number of batches for a submission recieved in multiple batches. BatchStatus 0..∞ BatchStatus Complex Type  Status of each batch for a submission recieved in multiple batches. Sequence  Index xs:unsignedShort  Unique Index of the submission in the batch submission. Status processingStatus Simple Type  Current Status of the batch in the Payroll Submission. Possible values are Pending, Completed or NotAcknowledged.   SubmissionHeader SubmissionHeader Complex Type  Header elements that were included in payroll submission that is being checked. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if payroll submission is filed by agent on behalf of employer. PayrollRunReference PayrollRunReference Simple Type  Data Item Ref: 4. Payroll Run Reference. Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. TaxYear dateYear Simple Type  Data Item Ref: 5. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 6 and 7. Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.     SubmissionSummary optional SubmissionSummary Complex Type  Summary totals for submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.   InvalidPayslip 0..∞ InvalidPayslip Complex Type  List of Invalid Payslips (if any). Any payslips in this list will not have been saved so the payslips will not feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required). Sequence  LineItemID payrollRunLineItemID Simple Type  LineItemID of the payslip containing validation errors. Error 1..∞ Error Complex Type  List of validation errors related to the payslip. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.     PayslipWarning 0..∞ PayslipWarning Complex Type  List of Payslip warnings (if any) associated with Valid payslips. Any payslips in this list will have been saved so the payslips will feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required). Sequence  LineItemID payrollRunLineItemID Simple Type  LineItemID of the payslip containing validation warnings. Warning 1..∞ Warning Complex Type  List of validation warnings related to the payslip. Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.     ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckPayrollSubmissionRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Source <xs:element name=CheckPayrollSubmissionResponse type=pp:CheckPayrollSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_127"]="Title¬PayrollSubmissionRequest Element,Content¬PayrollSubmissionRequest Element    : PayrollSubmissionRequest Element  Description Employer's PAYE Payroll Submission Request. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type PayrollSubmissionRequest Complex Type Diagram   Overview PayrollSubmissionRequest PayrollSubmissionRequest Complex Type  Employer's PAYE Payroll Submission Request. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: N/A. Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. For batch submissions, all submissions should have the same SubmissionID and should have the BatchID and BatchCount populated. BatchReference optional BatchReference Complex Type  Data Item Ref: N/A. Reference used when batching a submission into mulitple submissions. Current Batch Index and Total Batch Count required. Sequence  Index xs:unsignedShort  Unique number for a submission in a batch submission. Must be between 1 and the total count of batches that make up the full payroll submission.  Count xs:unsignedShort  Total number of submissions contained in a batch submission.   Header SubmissionHeader Complex Type  Required header level elements for a payroll submission. For batch submission messages, the same header data should be included in each message. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if payroll submission is filed by agent on behalf of employer. PayrollRunReference PayrollRunReference Simple Type  Data Item Ref: 4. Payroll Run Reference. Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. TaxYear dateYear Simple Type  Data Item Ref: 5. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 6 and 7. Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.     Payslip 0..∞ Payslip Complex Type  List of payslips that make up the employer payroll submission. for Original submissions this should include at least one new payslip. For Correction submissions this should include any new or corrected payslips. Sequence  LineItemID payrollRunLineItemID Simple Type  Data Item Ref: N/A. Unique reference to line item/s across submissions for a given payroll run. Used to uniquely identify individual line items for correction purposeses. PreviousLineItemID optional payrollRunLineItemID Simple Type  Data Item Ref: N/A. Used to identify a previous version of this line item when corrections are made. Can only reference line items within the same payroll run. EmployeeID optional EmployeeID Complex Type  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 8. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 14. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 13. Employee's internal staff identifier/reference. This will be Mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Name Name Complex Type  Employee Name. Mandatory. Sequence  FirstName defaultString Simple Type  Data Item Ref: 9. The first name of the employee. FamilyName defaultString Simple Type  Data Item Ref: 10. The surname/family name of the employee.   Address optional Address Complex Type  Elements required when Employee PPSN is not known. Sequence  AddressLine 1..3 defaultString Simple Type  Data Item Ref: 11(a)-(c). The address will be Mandatory if the PPSN isn’t available. Line 1 of the employee's address is required.  County optional county Simple Type  Data Item Ref: 11(d). County element of the employee's address. Eircode optional eircode Simple Type  Data Item Ref: 11(e). Employee's Eircode (if known). Used for Irish addresses only. CountryCode optional countryCode Simple Type  Data Item Ref: 11(f). Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.   DateOfBirth optional xs:date  Data Item Ref: 12. Employee's Date of Birth - format YYYY-MM-DD . This will be Mandatory if the PPSN isn’t available. StartDate optional xs:date  Data Item Ref: 15. Employment Start Date. Only include this for the first time you pay a new employee or if there is a correction being made to the StartDate. LeaveDate optional xs:date  Data Item Ref: 16. Report this date when an employee is leaving (date contract terminates) or if employer ceases trading. Director optional directorType Simple Type  Data Item Ref: 51. Director marker. Options allowed are Proprietary and NonProprietary.This should be included at start of Employment or if there is any change ShadowPayroll optional xs:boolean  Data Item Ref: 52. Shadow Payroll Indicator. Set to true for shadow payment. PayFrequency payFrequency Simple Type  Data Item Ref: 18. Pay Frequency. Options allowed are Weekly, Fortnightly, Monthly, FourWeekly, TwiceMonthly, Quarterly, BiAnnual, WkBasedMonthly, Annual and Other. PayPeriod optional xs:short  Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards). NumberOfPayPeriods optional xs:short  Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods). RPNNumber optional rpnNumber Simple Type  Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used TaxCredits optional defaultDecimal Simple Type  Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used. TaxRate 0..∞ TaxRate Complex Type  Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used. Sequence  Index xs:unsignedShort  Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1. RateCutOff defaultDecimal Simple Type  Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.   IncomeTaxCalculationBasis optional IncomeTaxCalculationBasis Simple Type  Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used. ExclusionOrder optional xs:boolean  Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee. This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee. PayDate xs:date  Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ). GrossPay defaultDecimal Simple Type  Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made. PayForIncomeTax defaultDecimal Simple Type  Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP and approved salary sacrifice. Euro and Cent required. IncomeTaxPaid defaultDecimal Simple Type  Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required. PayForEmployeePRSI defaultDecimal Simple Type  Data Item Ref: 27. Pay subject to employee PRSI. Euro and Cent required. PayForEmployerPRSI defaultDecimal Simple Type  Data Item Ref: 28. Pay subject to employer PRSI. Euro and Cent required. PRSIExempt xs:boolean  Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland. This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland. PRSIExemptionReason optional prsiExemptionReason Simple Type  Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers), FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other. PRSIClassDetail 0..∞ PRSIClassDetail Complex Type  PRSI Class, subclass and Insurable weeks detail. Sequence  PRSIClass prsiClass Simple Type  Data Item Ref: 31. PRSI Class and Subclass. Weeks required where class is provided. This is Mandatory if not PRSI exempt. InsurableWeeks xs:short  Data Item Ref: 32. Number of insurable weeks for each PRSI class accrued in this pay period. This is Mandatory if not PRSI exempt.   EmployeePRSIPaid optional defaultDecimal Simple Type  Data Item Ref: 33. Employee PRSI deducted. This is Mandatory if not PRSI exempt. EmployerPRSIPaid optional defaultDecimal Simple Type  Data Item Ref: 34. Employer PRSI Paid. This is Mandatory if not PRSI exempt. PayForUSC defaultDecimal Simple Type  Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes. USCStatus uscStatus Simple Type  Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt. USCPaid optional defaultDecimal Simple Type  Data Item Ref: 37. USC deducted or refunded in this employment. Negative if USC refunded. Required if USC Status is Ordinary. LPTDeducted optional defaultDecimal Simple Type  Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable. GrossMedicalInsurance optional defaultDecimal Simple Type  Data Item Ref: 38. Gross Medical Insurance paid by Employer for the Employee. This is mandatory if applicable. ShareBasedRemuneration optional defaultDecimal Simple Type  Data Item Ref: 46. This is share-based remuneration consisting of shares in the employer company or a company that controls the employer company that is included in ‘Gross Pay’. TaxableBenefits optional defaultDecimal Simple Type  Data Item Ref: 47. Taxable value of benefits provided to the employee. This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable. TaxableLumpSum optional defaultDecimal Simple Type  Data Item Ref: 48. Amount of taxable lump sum payment included in ‘Pay for Income Tax’. This is mandatory if applicable. NonTaxableLumpSum optional defaultDecimal Simple Type  Data Item Ref: 49. Amount of lump sum payment not included in ‘Pay for Income Tax’, excluding statutory redundancy payments. This is mandatory if applicable. PensionTracingNumber 0..∞ pensionTracingNumber Simple Type  Data Item Ref: 39. Pension Tracing Number. The format of the pension tracing number is “PBXXXXXX”, where XXXXXX is a number with up to 6 digits. E.g. PB123456. This is mandatory if applicable. Should only be provided when the Employee joins a pension or changes pension. EmployerRBS optional defaultDecimal Simple Type  Data Item Ref: 40. Amount contributed by employer to Retirement Benefit Scheme. EmployeeRBS optional defaultDecimal Simple Type  Data Item Ref: 41. Amount contributed by employee to Retirement Benefit Scheme. EmployerPRSA optional defaultDecimal Simple Type  Data Item Ref: 42. Amount contributed by employer to Personal Retirement Savings Accounts (PRSA) scheme. EmployeePRSA optional defaultDecimal Simple Type  Data Item Ref: 43. Amount contributed by employee to Personal Retirement Savings Accounts (PRSA) scheme. EmployeeRAC optional defaultDecimal Simple Type  Data Item Ref: 44. Amount contributed by employee to Retirement Annuity Contracts (RAC) scheme. EmployeeAVC optional defaultDecimal Simple Type  Data Item Ref: 45. Amount contributed by employee to Additional Voluntary Contributions (AVC) scheme. EmployeeASC optional defaultDecimal Simple Type  Data Item Ref: 54. Amount contributed by employee to Additional Superannuation Contribution (ASC) scheme. EmployerPEPP optional defaultDecimal Simple Type  Data Item Ref: 59. Amount contributed by employer to Pan-European Personal Pension Product (PEPP) scheme. EmployeePEPP optional defaultDecimal Simple Type  Data Item Ref: 60. Amount contributed by employee to Pan-European Personal Pension Product (PEPP) scheme. OtherPayments 0..∞ OtherPayments Complex Type  Other payments, payment code and payment value. Sequence  PaymentCode paymentCode Simple Type  Data Item Ref: 57. Description of other payment. Options allowed are COVID19, EWSS, EWSS_PHR, CODE_1, CODE_2, CODE_3, CODE_4 and CODE_5 PaymentValue defaultDecimal Simple Type  paymentValue: Data Item Ref: 58. Payment amount.     LineItemIDToDelete 0..∞ payrollRunLineItemID Simple Type  For Correction submissions, this should include any line item IDs across the payroll run to be deleted.    Source <xs:element name=PayrollSubmissionRequest type=pp:PayrollSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Employer's PAYE Payroll Submission Request.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_128"]="Title¬PayrollSubmissionResponse Element,Content¬PayrollSubmissionResponse Element    : PayrollSubmissionResponse Element  Description Acknowledges the receipt of an Employer's PAYE Payroll Submission Request, or Validation Errors if validation failed. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type PayrollSubmissionResponse Complex Type Diagram   Overview PayrollSubmissionResponse PayrollSubmissionResponse Complex Type  Acknowledges the receipt of an Employer's PAYE Payroll Submission Request, or Validation Errors if validation failed. Sequence  AcknowledgementStatus acknowledgementStatus Simple Type  Acknowledgement status for Employer's PAYE Payroll Submission Request. Possible values are Acknowledged or Rejected. AcknowledgementID optional acknowledgementID Simple Type  Unique ID for acknowledged requests - to be used for technical support if required. ValidationError 0..∞ Error Complex Type  List of Submission Validation Errors (if any). Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.   ValidationWarning 0..∞ Warning Complex Type  List of Submission Validation Warnings (if any). Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.      Source <xs:element name=PayrollSubmissionResponse type=pp:PayrollSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Acknowledges the receipt of an Employer's PAYE Payroll Submission Request, or Validation Errors if validation failed.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_129"]="Title¬Address Complex Type,Content¬Address Complex Type    : Address Complex Type  Description Employee Address. The address of the employee. This will be Mandatory if the PPSN isn’t available. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview Address  Employee Address. The address of the employee. This will be Mandatory if the PPSN isn’t available. Sequence  AddressLine 1..3 defaultString Simple Type  Data Item Ref: 11(a)-(c). The address will be Mandatory if the PPSN isn’t available. Line 1 of the employee's address is required.  County optional county Simple Type  Data Item Ref: 11(d). County element of the employee's address. Eircode optional eircode Simple Type  Data Item Ref: 11(e). Employee's Eircode (if known). Used for Irish addresses only. CountryCode optional countryCode Simple Type  Data Item Ref: 11(f). Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.    Used By Address Element  Source <xs:complexType name=Address xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Employee Address. The address of the employee. This will be Mandatory if the PPSN isn’t available.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=AddressLine type=pc:defaultString maxOccurs=3>       <xs:annotation>         <xs:documentation>Data Item Ref: 11(a)-(c). The address will be Mandatory if the PPSN isn’t available. Line 1 of the employee's address is required. </xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=County type=pc:county minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 11(d). County element of the employee's address.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Eircode type=pc:eircode minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 11(e). Employee's Eircode (if known). Used for Irish addresses only.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=CountryCode type=pc:countryCode minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 11(f). Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_130"]="Title¬BatchReference Complex Type,Content¬BatchReference Complex Type    : BatchReference Complex Type  Description References used for batching of a submission into multiple submissions Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview BatchReference  References used for batching of a submission into multiple submissions Sequence  Index xs:unsignedShort  Unique number for a submission in a batch submission. Must be between 1 and the total count of batches that make up the full payroll submission.  Count xs:unsignedShort  Total number of submissions contained in a batch submission.    Used By BatchReference Element  Source <xs:complexType name=BatchReference xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>References used for batching of a submission into multiple submissions</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Index type=xs:unsignedShort>       <xs:annotation>         <xs:documentation>Unique number for a submission in a batch submission. Must be between 1 and the total count of batches that make up the full payroll submission. </xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Count type=xs:unsignedShort>       <xs:annotation>         <xs:documentation>Total number of submissions contained in a batch submission.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_131"]="Title¬BatchStatus Complex Type,Content¬BatchStatus Complex Type    : BatchStatus Complex Type  Description Status of each batch for a submission recieved in multiple batches. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview BatchStatus  Status of each batch for a submission recieved in multiple batches. Sequence  Index xs:unsignedShort  Unique Index of the submission in the batch submission. Status processingStatus Simple Type  Current Status of the batch in the Payroll Submission. Possible values are Pending, Completed or NotAcknowledged.    Used By BatchStatus Element  Source <xs:complexType name=BatchStatus xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Status of each batch for a submission recieved in multiple batches.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Index type=xs:unsignedShort>       <xs:annotation>         <xs:documentation>Unique Index of the submission in the batch submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Status type=pc:processingStatus>       <xs:annotation>         <xs:documentation>Current Status of the batch in the Payroll Submission. Possible values are Pending, Completed or NotAcknowledged.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_132"]="Title¬CheckPayrollRunRequest Complex Type,Content¬CheckPayrollRunRequest Complex Type    : CheckPayrollRunRequest Complex Type  Description Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview CheckPayrollRunRequest  Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference. Sequence  EmployerRegistrationNumber employerReg Simple Type  Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Tax Advisor Identification Number. Required if payroll submission is filed by an agent on behalf of employer. TaxYear dateYear Simple Type  Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.   PayrollRunReference PayrollRunReference Simple Type  Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’.    Used By CheckPayrollRunRequest Element (Payroll)  Source <xs:complexType name=CheckPayrollRunRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Payroll Run, based on the RunReference.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployerRegistrationNumber type=pc:employerReg>       <xs:annotation>         <xs:documentation>Employer's PAYE Registration Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AgentTain type=pc:agentTAIN minOccurs=0>       <xs:annotation>         <xs:documentation>Tax Advisor Identification Number. Required if payroll submission is filed by an agent on behalf of employer.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxYear type=pc:dateYear>       <xs:annotation>         <xs:documentation>Used to identify the tax year to which the submission relates (YYYY).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SoftwareUsed type=pp:SoftwareUsed>       <xs:annotation>         <xs:documentation>Third party software product identifier.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayrollRunReference type=pc:PayrollRunReference>       <xs:annotation>         <xs:documentation>Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_133"]="Title¬CheckPayrollRunResponse Complex Type,Content¬CheckPayrollRunResponse Complex Type    : CheckPayrollRunResponse Complex Type  Description Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview CheckPayrollRunResponse  Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions. Sequence  Status processingStatus Simple Type  Current Status of Payroll Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the Payroll Run are at a status of Pending. TaxOnIncome optional xs:decimal  Total Tax on Income amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. PRSI optional xs:decimal  Total PRSI amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. USC optional xs:decimal  Total USC amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. LPT optional xs:decimal  Total LPT amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed. Submission 0..∞ SubmissionStatus Complex Type  High Level details of the Payroll Submissions that make up the Payroll Run. Sequence  SubmissionID submissionID Simple Type  Unique ID of the Payroll Submission. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. SubmissionSummary optional SubmissionSummary Complex Type  Summary details of submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.     PayslipSummary 0..∞ PayslipSummary Complex Type  Summary details of individual payslips that make up the Payroll Run. Sequence  LineItemID payrollRunLineItemID Simple Type  Data Item Ref: N/A. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 8. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 14. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 13. Employee's internal staff identifier/reference. This will be Mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. TaxOnIncome xs:decimal  Total Tax on Income for this payslip on submission. PRSI xs:decimal  Total PRSI amount for this payslip on submission. USC xs:decimal  Total USC amount for this payslip on submission. LPT xs:decimal  Total LPT amount for this payslip on submission.   ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckPayrollRunRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Used By CheckPayrollRunResponse Element (Payroll)  Source <xs:complexType name=CheckPayrollRunResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Payroll Run. Includes list of submissions that make up the payroll run and includes summary details of processed submissions.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Status type=pc:processingStatus>       <xs:annotation>         <xs:documentation>Current Status of Payroll Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the Payroll Run are at a status of Pending.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxOnIncome type=xs:decimal minOccurs=0>       <xs:annotation>         <xs:documentation>Total Tax on Income amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PRSI type=xs:decimal minOccurs=0>       <xs:annotation>         <xs:documentation>Total PRSI amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=USC type=xs:decimal minOccurs=0>       <xs:annotation>         <xs:documentation>Total USC amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=LPT type=xs:decimal minOccurs=0>       <xs:annotation>         <xs:documentation>Total LPT amount across valid line items for the payroll run. Included when all submissions received for the payroll run have been processed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Submission type=pp:SubmissionStatus minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>High Level details of the Payroll Submissions that make up the Payroll Run.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayslipSummary type=pp:PayslipSummary minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>Summary details of individual payslips that make up the Payroll Run.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationError type=pp:Error minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Errors (if any) on the CheckPayrollRunRequest.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_134"]="Title¬CheckPayrollSubmissionRequest Complex Type,Content¬CheckPayrollSubmissionRequest Complex Type    : CheckPayrollSubmissionRequest Complex Type  Description Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview CheckPayrollSubmissionRequest  Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID. Sequence  EmployerRegistrationNumber employerReg Simple Type  Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Tax Advisor Identification Number. Required if payroll submission filed by agent on behalf of employer. TaxYear dateYear Simple Type  Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.   PayrollRunReference PayrollRunReference Simple Type  Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. SubmissionID submissionID Simple Type  Unique Submission ID of the Employer Payroll Submission. Used to identify individual submissions.    Used By CheckPayrollSubmissionRequest Element (Payroll)  Source <xs:complexType name=CheckPayrollSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Payroll Submission, based on the Submission ID.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployerRegistrationNumber type=pc:employerReg>       <xs:annotation>         <xs:documentation>Employer's PAYE Registration Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AgentTain type=pc:agentTAIN minOccurs=0>       <xs:annotation>         <xs:documentation>Tax Advisor Identification Number. Required if payroll submission filed by agent on behalf of employer.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxYear type=pc:dateYear>       <xs:annotation>         <xs:documentation>Used to identify the tax year to which the submission relates (YYYY).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SoftwareUsed type=pp:SoftwareUsed>       <xs:annotation>         <xs:documentation>Third party software product identifier.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayrollRunReference type=pc:PayrollRunReference>       <xs:annotation>         <xs:documentation>Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Unique Submission ID of the Employer Payroll Submission. Used to identify individual submissions.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_135"]="Title¬CheckPayrollSubmissionResponse Complex Type,Content¬CheckPayrollSubmissionResponse Complex Type    : CheckPayrollSubmissionResponse Complex Type  Description Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview CheckPayrollSubmissionResponse  Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips. Sequence  SubmissionID submissionID Simple Type  Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. For batch submissions, all submissions should have the same SubmissionID and should have the BatchID and BatchCount populated. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. BatchCount optional xs:unsignedShort  Total number of batches for a submission recieved in multiple batches. BatchStatus 0..∞ BatchStatus Complex Type  Status of each batch for a submission recieved in multiple batches. Sequence  Index xs:unsignedShort  Unique Index of the submission in the batch submission. Status processingStatus Simple Type  Current Status of the batch in the Payroll Submission. Possible values are Pending, Completed or NotAcknowledged.   SubmissionHeader SubmissionHeader Complex Type  Header elements that were included in payroll submission that is being checked. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if payroll submission is filed by agent on behalf of employer. PayrollRunReference PayrollRunReference Simple Type  Data Item Ref: 4. Payroll Run Reference. Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. TaxYear dateYear Simple Type  Data Item Ref: 5. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 6 and 7. Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.     SubmissionSummary optional SubmissionSummary Complex Type  Summary totals for submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.   InvalidPayslip 0..∞ InvalidPayslip Complex Type  List of Invalid Payslips (if any). Any payslips in this list will not have been saved so the payslips will not feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required). Sequence  LineItemID payrollRunLineItemID Simple Type  LineItemID of the payslip containing validation errors. Error 1..∞ Error Complex Type  List of validation errors related to the payslip. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.     PayslipWarning 0..∞ PayslipWarning Complex Type  List of Payslip warnings (if any) associated with Valid payslips. Any payslips in this list will have been saved so the payslips will feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required). Sequence  LineItemID payrollRunLineItemID Simple Type  LineItemID of the payslip containing validation warnings. Warning 1..∞ Warning Complex Type  List of validation warnings related to the payslip. Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.     ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckPayrollSubmissionRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Used By CheckPayrollSubmissionResponse Element (Payroll)  Source <xs:complexType name=CheckPayrollSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Payroll Submission. If processed, includes summary totals of valid payslips and validation errors for invalid payslips.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. For batch submissions, all submissions should have the same SubmissionID and should have the BatchID and BatchCount populated.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Status type=pc:processingStatus>       <xs:annotation>         <xs:documentation>Current Status of Payroll Submission. Possible values are Pending or Completed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=BatchCount type=xs:unsignedShort minOccurs=0>       <xs:annotation>         <xs:documentation>Total number of batches for a submission recieved in multiple batches.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=BatchStatus type=pp:BatchStatus minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>Status of each batch for a submission recieved in multiple batches.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionHeader type=pp:SubmissionHeader>       <xs:annotation>         <xs:documentation>Header elements that were included in payroll submission that is being checked.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionSummary type=pp:SubmissionSummary minOccurs=0>       <xs:annotation>         <xs:documentation>Summary totals for submission. Included when submission has completed processing.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=InvalidPayslip type=pp:InvalidPayslip minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Invalid Payslips (if any). Any payslips in this list will not have been saved so the payslips will not feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayslipWarning type=pp:PayslipWarning minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Payslip warnings (if any) associated with Valid payslips. Any payslips in this list will have been saved so the payslips will feed into the employer liability for the statuatory return for the period. Included when the submission has completed processing (if required).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationError type=pp:Error minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Errors (if any) on the CheckPayrollSubmissionRequest.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
