s["_151"]="Title¬TaxRate Complex Type,Content¬TaxRate Complex Type    : TaxRate Complex Type  Description Detail of Rate Cut Off. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Diagram   Overview TaxRate  Detail of Rate Cut Off. Sequence  Index xs:unsignedShort  Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1. RateCutOff defaultDecimal Simple Type  Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.    Used By TaxRate Element  Source <xs:complexType name=TaxRate xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Detail of Rate Cut Off.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Index type=xs:unsignedShort>       <xs:annotation>         <xs:documentation>Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=RateCutOff type=pc:defaultDecimal>       <xs:annotation>         <xs:documentation>Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
