s["_172"]="Title¬PayslipSummary Element,Content¬PayslipSummary Element    > CheckPayrollRunResponse Complex Type : PayslipSummary Element  Description Summary details of individual payslips that make up the Payroll Run. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type PayslipSummary Complex Type Diagram   Overview PayslipSummary 0..∞ PayslipSummary Complex Type  Summary details of individual payslips that make up the Payroll Run. Sequence  LineItemID payrollRunLineItemID Simple Type  Data Item Ref: N/A. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 8. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 14. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 13. Employee's internal staff identifier/reference. This will be Mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. TaxOnIncome xs:decimal  Total Tax on Income for this payslip on submission. PRSI xs:decimal  Total PRSI amount for this payslip on submission. USC xs:decimal  Total USC amount for this payslip on submission. LPT xs:decimal  Total LPT amount for this payslip on submission.    Source <xs:element name=PayslipSummary type=pp:PayslipSummary minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Summary details of individual payslips that make up the Payroll Run.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckPayrollRunResponse Complex Type |"
