s["_207"]="Title¬ValidationError Element,Content¬ValidationError Element    > PayrollSubmissionResponse Complex Type : ValidationError Element  Description List of Submission Validation Errors (if any). Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type Error Complex Type Diagram   Overview ValidationError 0..∞ Error Complex Type  List of Submission Validation Errors (if any). Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.    Source <xs:element name=ValidationError type=pp:Error minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Submission Validation Errors (if any).</xs:documentation>   </xs:annotation> </xs:element>  See Also PayrollSubmissionResponse Complex Type |"
s["_208"]="Title¬ValidationWarning Element,Content¬ValidationWarning Element    > PayrollSubmissionResponse Complex Type : ValidationWarning Element  Description List of Submission Validation Warnings (if any). Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type Warning Complex Type Diagram   Overview ValidationWarning 0..∞ Warning Complex Type  List of Submission Validation Warnings (if any). Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.    Source <xs:element name=ValidationWarning type=pp:Warning minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Submission Validation Warnings (if any).</xs:documentation>   </xs:annotation> </xs:element>  See Also PayrollSubmissionResponse Complex Type |"
