s["_219"]="Title¬ShadowPayroll Element,Content¬ShadowPayroll Element    > Payslip Complex Type : ShadowPayroll Element  Description Data Item Ref: 52. Shadow Payroll Indicator. Set to true for shadow payment. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:boolean Diagram   Overview ShadowPayroll optional xs:boolean  Data Item Ref: 52. Shadow Payroll Indicator. Set to true for shadow payment.  Source <xs:element name=ShadowPayroll type=xs:boolean minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 52. Shadow Payroll Indicator. Set to true for shadow payment.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_220"]="Title¬PayFrequency Element,Content¬PayFrequency Element    > Payslip Complex Type : PayFrequency Element  Description Data Item Ref: 18. Pay Frequency. Options allowed are Weekly, Fortnightly, Monthly, FourWeekly, TwiceMonthly, Quarterly, BiAnnual, WkBasedMonthly, Annual and Other. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type payFrequency Simple Type Diagram   Overview PayFrequency payFrequency Simple Type  Data Item Ref: 18. Pay Frequency. Options allowed are Weekly, Fortnightly, Monthly, FourWeekly, TwiceMonthly, Quarterly, BiAnnual, WkBasedMonthly, Annual and Other.  Source <xs:element name=PayFrequency type=pp:payFrequency xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 18. Pay Frequency. Options allowed are Weekly, Fortnightly, Monthly, FourWeekly, TwiceMonthly, Quarterly, BiAnnual, WkBasedMonthly, Annual and Other.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_221"]="Title¬PayPeriod Element,Content¬PayPeriod Element    > Payslip Complex Type : PayPeriod Element  Description Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards). Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:short Diagram   Overview PayPeriod optional xs:short  Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards).  Source <xs:element name=PayPeriod type=xs:short minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_222"]="Title¬NumberOfPayPeriods Element,Content¬NumberOfPayPeriods Element    > Payslip Complex Type : NumberOfPayPeriods Element  Description Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods). Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:short Diagram   Overview NumberOfPayPeriods optional xs:short  Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods).  Source <xs:element name=NumberOfPayPeriods type=xs:short minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_223"]="Title¬RPNNumber Element,Content¬RPNNumber Element    > Payslip Complex Type : RPNNumber Element  Description Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type rpnNumber Simple Type Diagram   Overview RPNNumber optional rpnNumber Simple Type  Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used  Source <xs:element name=RPNNumber type=pc:rpnNumber minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_224"]="Title¬TaxCredits Element,Content¬TaxCredits Element    > Payslip Complex Type : TaxCredits Element  Description Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview TaxCredits optional defaultDecimal Simple Type  Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used.  Source <xs:element name=TaxCredits type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_225"]="Title¬TaxRate Element,Content¬TaxRate Element    > Payslip Complex Type : TaxRate Element  Description Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type TaxRate Complex Type Diagram   Overview TaxRate 0..∞ TaxRate Complex Type  Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used. Sequence  Index xs:unsignedShort  Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1. RateCutOff defaultDecimal Simple Type  Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.    Source <xs:element name=TaxRate type=pp:TaxRate minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_226"]="Title¬IncomeTaxCalculationBasis Element,Content¬IncomeTaxCalculationBasis Element    > Payslip Complex Type : IncomeTaxCalculationBasis Element  Description Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type IncomeTaxCalculationBasis Simple Type Diagram   Overview IncomeTaxCalculationBasis optional IncomeTaxCalculationBasis Simple Type  Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used.  Source <xs:element name=IncomeTaxCalculationBasis type=pc:IncomeTaxCalculationBasis minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_227"]="Title¬ExclusionOrder Element,Content¬ExclusionOrder Element    > Payslip Complex Type : ExclusionOrder Element  Description Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee. This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:boolean Diagram   Overview ExclusionOrder optional xs:boolean  Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee. This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee.  Source <xs:element name=ExclusionOrder type=xs:boolean minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee.  This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_228"]="Title¬PayDate Element,Content¬PayDate Element    > Payslip Complex Type : PayDate Element  Description Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ). Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:date Diagram   Overview PayDate xs:date  Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ).  Source <xs:element name=PayDate type=xs:date xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_229"]="Title¬GrossPay Element,Content¬GrossPay Element    > Payslip Complex Type : GrossPay Element  Description Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview GrossPay defaultDecimal Simple Type  Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made.  Source <xs:element name=GrossPay type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_230"]="Title¬PayForIncomeTax Element,Content¬PayForIncomeTax Element    > Payslip Complex Type : PayForIncomeTax Element  Description Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP and approved salary sacrifice. Euro and Cent required. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview PayForIncomeTax defaultDecimal Simple Type  Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP and approved salary sacrifice. Euro and Cent required.  Source <xs:element name=PayForIncomeTax type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP  and approved salary sacrifice.  Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_231"]="Title¬IncomeTaxPaid Element,Content¬IncomeTaxPaid Element    > Payslip Complex Type : IncomeTaxPaid Element  Description Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview IncomeTaxPaid defaultDecimal Simple Type  Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required.  Source <xs:element name=IncomeTaxPaid type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_232"]="Title¬PayForEmployeePRSI Element,Content¬PayForEmployeePRSI Element    > Payslip Complex Type : PayForEmployeePRSI Element  Description Data Item Ref: 27. Pay subject to employee PRSI. Euro and Cent required. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview PayForEmployeePRSI defaultDecimal Simple Type  Data Item Ref: 27. Pay subject to employee PRSI. Euro and Cent required.  Source <xs:element name=PayForEmployeePRSI type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 27. Pay subject to employee PRSI. Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_233"]="Title¬PayForEmployerPRSI Element,Content¬PayForEmployerPRSI Element    > Payslip Complex Type : PayForEmployerPRSI Element  Description Data Item Ref: 28. Pay subject to employer PRSI. Euro and Cent required. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview PayForEmployerPRSI defaultDecimal Simple Type  Data Item Ref: 28. Pay subject to employer PRSI. Euro and Cent required.  Source <xs:element name=PayForEmployerPRSI type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 28. Pay subject to employer PRSI. Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_234"]="Title¬PRSIExempt Element,Content¬PRSIExempt Element    > Payslip Complex Type : PRSIExempt Element  Description Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland. This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type xs:boolean Diagram   Overview PRSIExempt xs:boolean  Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland. This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland.  Source <xs:element name=PRSIExempt type=xs:boolean xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland.  This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_235"]="Title¬PRSIExemptionReason Element,Content¬PRSIExemptionReason Element    > Payslip Complex Type : PRSIExemptionReason Element  Description Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers), FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type prsiExemptionReason Simple Type Diagram   Overview PRSIExemptionReason optional prsiExemptionReason Simple Type  Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers), FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other.  Source <xs:element name=PRSIExemptionReason type=pc:prsiExemptionReason minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers),  FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_236"]="Title¬PRSIClassDetail Element,Content¬PRSIClassDetail Element    > Payslip Complex Type : PRSIClassDetail Element  Description PRSI Class, subclass and Insurable weeks detail. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type PRSIClassDetail Complex Type Diagram   Overview PRSIClassDetail 0..∞ PRSIClassDetail Complex Type  PRSI Class, subclass and Insurable weeks detail. Sequence  PRSIClass prsiClass Simple Type  Data Item Ref: 31. PRSI Class and Subclass. Weeks required where class is provided. This is Mandatory if not PRSI exempt. InsurableWeeks xs:short  Data Item Ref: 32. Number of insurable weeks for each PRSI class accrued in this pay period. This is Mandatory if not PRSI exempt.    Source <xs:element name=PRSIClassDetail type=pp:PRSIClassDetail minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>PRSI Class, subclass and Insurable weeks detail.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_237"]="Title¬EmployeePRSIPaid Element,Content¬EmployeePRSIPaid Element    > Payslip Complex Type : EmployeePRSIPaid Element  Description Data Item Ref: 33. Employee PRSI deducted. This is Mandatory if not PRSI exempt. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview EmployeePRSIPaid optional defaultDecimal Simple Type  Data Item Ref: 33. Employee PRSI deducted. This is Mandatory if not PRSI exempt.  Source <xs:element name=EmployeePRSIPaid type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 33. Employee PRSI deducted. This is Mandatory if not PRSI exempt.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_238"]="Title¬EmployerPRSIPaid Element,Content¬EmployerPRSIPaid Element    > Payslip Complex Type : EmployerPRSIPaid Element  Description Data Item Ref: 34. Employer PRSI Paid. This is Mandatory if not PRSI exempt. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview EmployerPRSIPaid optional defaultDecimal Simple Type  Data Item Ref: 34. Employer PRSI Paid. This is Mandatory if not PRSI exempt.  Source <xs:element name=EmployerPRSIPaid type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 34. Employer PRSI Paid. This is Mandatory if not PRSI exempt.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_239"]="Title¬PayForUSC Element,Content¬PayForUSC Element    > Payslip Complex Type : PayForUSC Element  Description Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview PayForUSC defaultDecimal Simple Type  Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes.  Source <xs:element name=PayForUSC type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_240"]="Title¬USCStatus Element,Content¬USCStatus Element    > Payslip Complex Type : USCStatus Element  Description Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type uscStatus Simple Type Diagram   Overview USCStatus uscStatus Simple Type  Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt.  Source <xs:element name=USCStatus type=pc:uscStatus xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_241"]="Title¬USCPaid Element,Content¬USCPaid Element    > Payslip Complex Type : USCPaid Element  Description Data Item Ref: 37. USC deducted or refunded in this employment. Negative if USC refunded. Required if USC Status is Ordinary. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview USCPaid optional defaultDecimal Simple Type  Data Item Ref: 37. USC deducted or refunded in this employment. Negative if USC refunded. Required if USC Status is Ordinary.  Source <xs:element name=USCPaid type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 37. USC deducted or refunded in this employment. Negative if USC refunded. Required if USC Status is Ordinary.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_242"]="Title¬LPTDeducted Element,Content¬LPTDeducted Element    > Payslip Complex Type : LPTDeducted Element  Description Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview LPTDeducted optional defaultDecimal Simple Type  Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable.  Source <xs:element name=LPTDeducted type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
