s["_245"]="Title¬TaxableBenefits Element,Content¬TaxableBenefits Element    > Payslip Complex Type : TaxableBenefits Element  Description Data Item Ref: 47. Taxable value of benefits provided to the employee. This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/payroll/  Type defaultDecimal Simple Type Diagram   Overview TaxableBenefits optional defaultDecimal Simple Type  Data Item Ref: 47. Taxable value of benefits provided to the employee. This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable.  Source <xs:element name=TaxableBenefits type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 47. Taxable value of benefits provided to the employee.   This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
