s["_294"]="Title¬LookupPayrollDetailsByReturnPeriodRequest Element,Content¬LookupPayrollDetailsByReturnPeriodRequest Element    : LookupPayrollDetailsByReturnPeriodRequest Element  Description Employer/Agent requests to view a return for a specific period. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/returns_reconciliation/  Type LookupPayrollDetailsByReturnPeriodRequest Complex Type Diagram   Overview LookupPayrollDetailsByReturnPeriodRequest LookupPayrollDetailsByReturnPeriodRequest Complex Type  Employer/Agent requests to view a return for a specific period. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 201. Employer's PAYE-EMP Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 202. Tax Advisor Identification Number. Required if the Payroll Return by Period request is filed by an agent on behalf of an employer. SoftwareUsed SoftwareUsed Complex Type  Data Item Ref: N/A. Third party software product identifier. Sequence  Name defaultString Simple Type  Data Item Ref: 205. Name of the third party software used. Version defaultString Simple Type  Data Item Ref: 206. Version of the third party software used.   ReturnPeriod ReturnPeriod Complex Type  Data Item Ref: N/A. The period the Return relates to. Sequence  PeriodStartDate xs:date  Data Item Ref: 203. Period start date e.g. 01/01/2019. Used to identify the period the request relates to. PeriodEndDate xs:date  Data Item Ref: 204. Period end date e.g.31/01/2019. Used to identify the period the request relates to.      Source <xs:element name=LookupPayrollDetailsByReturnPeriodRequest type=rr:LookupPayrollDetailsByReturnPeriodRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Employer/Agent requests to view a return for a specific period.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_295"]="Title¬LookupPayrollDetailsByReturnPeriodResponse Element,Content¬LookupPayrollDetailsByReturnPeriodResponse Element    : LookupPayrollDetailsByReturnPeriodResponse Element  Description Response that lets the employer/agent view a return for a specific period. Namespacehttp://www.ros.ie/schemas/paye-employers/v1/returns_reconciliation/  Type LookupPayrollDetailsByReturnPeriodResponse Complex Type Diagram   Overview LookupPayrollDetailsByReturnPeriodResponse LookupPayrollDetailsByReturnPeriodResponse Complex Type  Response that lets the employer/agent view a return for a specific period. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 201. Employer's PAYE-EMP Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 202. Tax Advisor Identification Number. Returned if the Payroll Return by Period request was filed by an agent on behalf of an employer. ReturnPeriod ReturnPeriod Complex Type  Data Item Ref: N/A. The period the return relates to. Sequence  PeriodStartDate xs:date  Data Item Ref: 203. Period start date e.g. 01/01/2019. Used to identify the period the request relates to. PeriodEndDate xs:date  Data Item Ref: 204. Period end date e.g.31/01/2019. Used to identify the period the request relates to.   DateLastUpdated optional xs:date  Data Item Ref: 208. This date indicates when the return was last updated. Version optional version Simple Type  Data Item Ref: 207. Indicates the version of the return that is being requested.  PeriodSummary optional PeriodSummary Complex Type  Data Item Ref: N/A. The overall totals for PAYE, PRSI (employer and employee), USC and LPT in the selected period. Sequence  TaxOnIncome xs:decimal  Data Item Ref: 209. The overall total income tax for the period. (Only payroll figures with pay dates in the selected period are included in this period's totals). PRSI xs:decimal  Data Item Ref: 210. The overall total PRSI (employer and employee) for the period. (Only payroll figures with pay dates in the selected period are included in this period's totals). USC xs:decimal  Data Item Ref: 211. The overall total USC for the period. (Only payroll figures with pay dates in the selected period are included in this period's totals). LPT xs:decimal  Data Item Ref: 212. The overall total LPT for the period. (Only payroll figures with pay dates in the selected period are included in this period's totals).   PayrollRunDetails 0..∞ PayrollRunDetails Complex Type  Data Item Ref: N/A. List of individual payroll runs with pay dates in the selected period. Sequence  PayrollRunReference PayrollRunReference Simple Type  Data Item Ref: 213. The reference number identifies a specific payroll run. RunDate xs:date  Data Item Ref: 214. The date the payroll run was submitted or last updated. multiPeriod xs:boolean  Data Item Ref: 215. Indicates if the Payroll Run includes pay dates in other periods. (Only payroll figures with pay dates in the selected period are included in this period's totals). TaxOnIncome xs:decimal  Data Item Ref: 216. The total amount of Income Tax in the payroll run for this period. (Only payroll figures with pay dates in the selected period are included in this period's totals). PRSI xs:decimal  Data Item Ref: 217. The total amount of PRSI (employer and employee) in the payroll run for this period. (Only payroll figures with pay dates in the selected period are included in this period's totals). USC xs:decimal  Data Item Ref: 218. The total amount of USC in the payroll run for this period. (Only payroll figures with pay dates in the selected period are included in this period's totals). LPT xs:decimal  Data Item Ref: 219. The total amount of LPT in the payroll run for this period. (Only payroll figures with pay dates in the selected period are included in this period's totals).   ValidationError 0..∞ Error Complex Type  List of Submission Validation Errors (if any). Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Source <xs:element name=LookupPayrollDetailsByReturnPeriodResponse type=rr:LookupPayrollDetailsByReturnPeriodResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Response that lets the employer/agent view a return for a specific period.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
