s["_379"]="Title¬ERN Element,Content¬ERN Element    > LookUpERNResponse Complex Type : ERN Element  Description Data Item Ref: N/A. List of valid ERNs. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/ern/  Type ERN Complex Type Diagram   Overview ERN 0..∞ ERN Complex Type  Data Item Ref: N/A. List of valid ERNs. Sequence  EmployeeID EmployeeID Complex Type  Employee's PPS Number and Employment ID (if available). Sequence  EmployeePPSN EmployeePPSN Simple Type  Employee's PPS Number. EmploymentID optional employmentID Simple Type  Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   Name optional Name Complex Type  The employee name. Sequence  FirstName defaultString Simple Type  The first name of the employee. FamilyName defaultString Simple Type  The surname/family name of the employee.   EmploymentCeased xs:boolean  Employment ceased marker.    Source <xs:element name=ERN type=pn:ERN minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: N/A. List of valid ERNs.</xs:documentation>   </xs:annotation> </xs:element>  See Also LookUpERNResponse Complex Type |"
s["_380"]="Title¬NoERN Element,Content¬NoERN Element    > LookUpERNResponse Complex Type : NoERN Element  Description Data Item Ref: N/A. EmployeePPSNs of employees who do not currently have an employment associated with the employer. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/ern/  Type EmployeePPSN Simple Type Diagram   Overview NoERN 0..∞ EmployeePPSN Simple Type  Data Item Ref: N/A. EmployeePPSNs of employees who do not currently have an employment associated with the employer.  Source <xs:element name=NoERN type=pc:EmployeePPSN minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: N/A. EmployeePPSNs of employees who do not currently have an employment associated with the employer.</xs:documentation>   </xs:annotation> </xs:element>  See Also LookUpERNResponse Complex Type |"
s["_381"]="Title¬ValidationError Element,Content¬ValidationError Element    > LookUpERNResponse Complex Type : ValidationError Element  Description Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/ern/  Type ErrorWithId Complex Type Diagram   Overview ValidationError 0..∞ ErrorWithId Complex Type  Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.    Source <xs:element name=ValidationError type=pn:ErrorWithId minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer.</xs:documentation>   </xs:annotation> </xs:element>  See Also LookUpERNResponse Complex Type |"
s["_382"]="Title¬FirstName Element,Content¬FirstName Element    > Name Complex Type : FirstName Element  Description The first name of the employee. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/ern/  Type defaultString Simple Type Diagram   Overview FirstName defaultString Simple Type  The first name of the employee.  Source <xs:element name=FirstName type=pc:defaultString xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>The first name of the employee.</xs:documentation>   </xs:annotation> </xs:element>  See Also Name Complex Type |"
