s["_446"]="Title¬InvalidExpenseBenefit Element,Content¬InvalidExpenseBenefit Element    > CheckErrSubmissionResponse Complex Type : InvalidExpenseBenefit Element  Description List of Invalid Expense Benefits (if any). Any in this list will not have been saved. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/enhanced_reporting/  Type InvalidExpenseBenefit Complex Type Diagram   Overview InvalidExpenseBenefit 0..∞ InvalidExpenseBenefit Complex Type  List of Invalid Expense Benefits (if any). Any in this list will not have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation errors. Error 1..∞ Error Complex Type  List of validation errors related to the Expense Benefit. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Source <xs:element name=InvalidExpenseBenefit type=pp:InvalidExpenseBenefit minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Invalid Expense Benefits (if any). Any in this list will not have been saved.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrSubmissionResponse Complex Type |"
s["_447"]="Title¬WarningExpenseBenefit Element,Content¬WarningExpenseBenefit Element    > CheckErrSubmissionResponse Complex Type : WarningExpenseBenefit Element  Description List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/enhanced_reporting/  Type WarningExpenseBenefit Complex Type Diagram   Overview WarningExpenseBenefit 0..∞ WarningExpenseBenefit Complex Type  List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation warnings. Warning 1..∞ Warning Complex Type  List of validation warnings related to the Expense Benefit. Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.      Source <xs:element name=WarningExpenseBenefit type=pp:WarningExpenseBenefit minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrSubmissionResponse Complex Type |"
s["_448"]="Title¬ValidationError Element,Content¬ValidationError Element    > CheckErrSubmissionResponse Complex Type : ValidationError Element  Description List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Namespacehttp://www.ros.ie/schemas/paye-employers/err/v1/enhanced_reporting/  Type ErrorWithId Complex Type Diagram   Overview ValidationError 0..∞ ErrorWithId Complex Type  List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.    Source <xs:element name=ValidationError type=pp:ErrorWithId minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrSubmissionResponse Complex Type |"
