s["_685"]="Title¬SubmissionHeader Complex Type,Content¬SubmissionHeader Complex Type    : SubmissionHeader Complex Type  Description Required header level elements for a payroll submission. Namespace  Diagram   Overview SubmissionHeader  Required header level elements for a payroll submission. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if payroll submission is filed by agent on behalf of employer. PayrollRunReference PayrollRunReference Simple Type  Data Item Ref: 4. Payroll Run Reference. Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’. TaxYear dateYear Simple Type  Data Item Ref: 5. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 6 and 7. Third party software product identifier. Sequence  Name defaultString Simple Type  Name of third party software product. Version defaultString Simple Type  Version of third party software product.      Used By Header Element  SubmissionHeader Element  Source <xs:complexType name=SubmissionHeader xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Required header level elements for a payroll submission.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployerRegistrationNumber type=pc:employerReg>       <xs:annotation>         <xs:documentation>Data Item Ref: 1. Employer's PAYE Registration Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AgentTain type=pc:agentTAIN minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 2. Tax Advisor Identification Number. Required if payroll submission is filed by agent on behalf of employer.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayrollRunReference type=pc:PayrollRunReference>       <xs:annotation>         <xs:documentation>Data Item Ref: 4. Payroll Run Reference. Used to identify the Payroll event that the submission refers to e.g. ‘Site_1_Week_1’.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxYear type=pc:dateYear>       <xs:annotation>         <xs:documentation>Data Item Ref: 5. Used to identify the tax year to which the submission relates (YYYY).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SoftwareUsed type=pp:SoftwareUsed>       <xs:annotation>         <xs:documentation>Data Item Refs: 6 and 7. Third party software product identifier.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_686"]="Title¬SubmissionStatus Complex Type,Content¬SubmissionStatus Complex Type    : SubmissionStatus Complex Type  Description High Level details of the Payroll Submissions that make up the Payroll Run. Namespace  Diagram   Overview SubmissionStatus  High Level details of the Payroll Submissions that make up the Payroll Run. Sequence  SubmissionID submissionID Simple Type  Unique ID of the Payroll Submission. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. SubmissionSummary optional SubmissionSummary Complex Type  Summary details of submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.      Used By Submission Element  Source <xs:complexType name=SubmissionStatus xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>High Level details of the Payroll Submissions that make up the Payroll Run.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Unique ID of the Payroll Submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Status type=pc:processingStatus>       <xs:annotation>         <xs:documentation>Current Status of Payroll Submission. Possible values are Pending or Completed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionSummary type=pp:SubmissionSummary minOccurs=0>       <xs:annotation>         <xs:documentation>Summary details of submission. Included when submission has completed processing.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_687"]="Title¬SubmissionSummary Complex Type,Content¬SubmissionSummary Complex Type    : SubmissionSummary Complex Type  Description Summary totals and count accross valid line items for a Payroll Submission or Payroll Run. Namespace  Diagram   Overview SubmissionSummary  Summary totals and count accross valid line items for a Payroll Submission or Payroll Run. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.    Used By SubmissionSummary Element  SubmissionSummary Element  Source <xs:complexType name=SubmissionSummary xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Summary totals and count accross valid line items for a Payroll Submission or Payroll Run.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=TaxOnIncome type=xs:decimal>       <xs:annotation>         <xs:documentation>Total Tax on Income amount across valid line items on submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PRSI type=xs:decimal>       <xs:annotation>         <xs:documentation>Total PRSI amount across valid line items on submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=USC type=xs:decimal>       <xs:annotation>         <xs:documentation>Total USC amount across valid line items on submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=LPT type=xs:decimal>       <xs:annotation>         <xs:documentation>Total LPT amount across valid line items on submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayslipCount type=xs:unsignedInt>       <xs:annotation>         <xs:documentation>Total number of payslip line items included on submission.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=PayslipToDeleteCount type=xs:unsignedInt>       <xs:annotation>         <xs:documentation>Total number of payslip line item IDs for deletion included on submission.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_688"]="Title¬TaxRate Complex Type,Content¬TaxRate Complex Type    : TaxRate Complex Type  Description Detail of Rate Cut Off. Namespace  Diagram   Overview TaxRate  Detail of Rate Cut Off. Sequence  Index xs:unsignedShort  Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1. RateCutOff defaultDecimal Simple Type  Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.    Used By TaxRate Element  Source <xs:complexType name=TaxRate xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Detail of Rate Cut Off.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Index type=xs:unsignedShort>       <xs:annotation>         <xs:documentation>Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=RateCutOff type=pc:defaultDecimal>       <xs:annotation>         <xs:documentation>Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
