s["_708"]="Title¬Submission Element,Content¬Submission Element    > CheckPayrollRunResponse Complex Type : Submission Element  Description High Level details of the Payroll Submissions that make up the Payroll Run. Namespace  Type SubmissionStatus Complex Type Diagram   Overview Submission 0..∞ SubmissionStatus Complex Type  High Level details of the Payroll Submissions that make up the Payroll Run. Sequence  SubmissionID submissionID Simple Type  Unique ID of the Payroll Submission. Status processingStatus Simple Type  Current Status of Payroll Submission. Possible values are Pending or Completed. SubmissionSummary optional SubmissionSummary Complex Type  Summary details of submission. Included when submission has completed processing. Sequence  TaxOnIncome xs:decimal  Total Tax on Income amount across valid line items on submission. PRSI xs:decimal  Total PRSI amount across valid line items on submission. USC xs:decimal  Total USC amount across valid line items on submission. LPT xs:decimal  Total LPT amount across valid line items on submission. PayslipCount xs:unsignedInt  Total number of payslip line items included on submission. PayslipToDeleteCount xs:unsignedInt  Total number of payslip line item IDs for deletion included on submission.      Source <xs:element name=Submission type=pp:SubmissionStatus minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>High Level details of the Payroll Submissions that make up the Payroll Run.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckPayrollRunResponse Complex Type |"
s["_709"]="Title¬PayslipSummary Element,Content¬PayslipSummary Element    > CheckPayrollRunResponse Complex Type : PayslipSummary Element  Description Summary details of individual payslips that make up the Payroll Run. Namespace  Type PayslipSummary Complex Type Diagram   Overview PayslipSummary 0..∞ PayslipSummary Complex Type  Summary details of individual payslips that make up the Payroll Run. Sequence  LineItemID payrollRunLineItemID Simple Type  Data Item Ref: N/A. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 8. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 14. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 13. Employee's internal staff identifier/reference. This will be Mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. TaxOnIncome xs:decimal  Total Tax on Income for this payslip on submission. PRSI xs:decimal  Total PRSI amount for this payslip on submission. USC xs:decimal  Total USC amount for this payslip on submission. LPT xs:decimal  Total LPT amount for this payslip on submission.    Source <xs:element name=PayslipSummary type=pp:PayslipSummary minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Summary details of individual payslips that make up the Payroll Run.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckPayrollRunResponse Complex Type |"
