s["_758"]="Title¬PayPeriod Element,Content¬PayPeriod Element    > Payslip Complex Type : PayPeriod Element  Description Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards). Namespace  Type xs:short Diagram   Overview PayPeriod optional xs:short  Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards).  Source <xs:element name=PayPeriod type=xs:short minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 55. Pay Period. Options allowed are 1-53 determined by the payment date and pay frequency. Input options allowed are 1-53 where payment frequency is weekly, 1-27 for fortnightly, 1-24 for twice monthly, 1-12 for monthly, 1-14 for week-based monthly, 1-14 for four-weekly, 1-4 for quarterly, 1-2 for bi-annual, 1 for annual and 1-52 when payment frequency is other. Where an employee is on a week 1 basis, the pay period that would be applied by software were it not for week 1 basis should be reported (required from 2020 onwards).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_759"]="Title¬NumberOfPayPeriods Element,Content¬NumberOfPayPeriods Element    > Payslip Complex Type : NumberOfPayPeriods Element  Description Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods). Namespace  Type xs:short Diagram   Overview NumberOfPayPeriods optional xs:short  Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods).  Source <xs:element name=NumberOfPayPeriods type=xs:short minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 53. Expected number of pay periods in a full year. Options allowed are 13, 14, 26, 27, 52, 53 and Other. Used to determine whether a week 1 or cumulative RPN should be provided when an employee moves jobs or pay frequencies. (Required for certain pay periods).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_760"]="Title¬RPNNumber Element,Content¬RPNNumber Element    > Payslip Complex Type : RPNNumber Element  Description Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used Namespace  Type rpnNumber Simple Type Diagram   Overview RPNNumber optional rpnNumber Simple Type  Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used  Source <xs:element name=RPNNumber type=pc:rpnNumber minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 19. The number of the Revenue Payroll Notification (RPN) used to calculate deductions. This is mandatory when the RPN is used</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_761"]="Title¬TaxCredits Element,Content¬TaxCredits Element    > Payslip Complex Type : TaxCredits Element  Description Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used. Namespace  Type defaultDecimal Simple Type Diagram   Overview TaxCredits optional defaultDecimal Simple Type  Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used.  Source <xs:element name=TaxCredits type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 21. Amount of tax credits available for use in the PAYE calculation. Where the employee is taxed on a cumulative basis, this will be the cumulative amount of tax credits for the pay period. This is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_762"]="Title¬TaxRate Element,Content¬TaxRate Element    > Payslip Complex Type : TaxRate Element  Description Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used. Namespace  Type TaxRate Complex Type Diagram   Overview TaxRate 0..∞ TaxRate Complex Type  Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used. Sequence  Index xs:unsignedShort  Data Item Ref: N/A. Index of the tax rate. For example, Index of 1 would refer to tax rate 1. RateCutOff defaultDecimal Simple Type  Data Item Ref: 20. Amount of Cut Off Point available for use in the PAYE calculation for selected rate. Where the employee is taxed on a week 1 basis, this will be the cut off point for the pay period. If the employee is taxed on the cumulative basis, this will be the cumulative cut off point for the pay period. This is mandatory when the RPN is not used.    Source <xs:element name=TaxRate type=pp:TaxRate minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Details of Rate Cut Offs. At least one TaxRate (with Index value of 1) is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_763"]="Title¬IncomeTaxCalculationBasis Element,Content¬IncomeTaxCalculationBasis Element    > Payslip Complex Type : IncomeTaxCalculationBasis Element  Description Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used. Namespace  Type IncomeTaxCalculationBasis Simple Type Diagram   Overview IncomeTaxCalculationBasis optional IncomeTaxCalculationBasis Simple Type  Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used.  Source <xs:element name=IncomeTaxCalculationBasis type=pc:IncomeTaxCalculationBasis minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 22. PAYE calculation basis used in the submission. Options allowed are Cumulative, Week1 and Emergency. This is mandatory when the RPN is not used.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_764"]="Title¬ExclusionOrder Element,Content¬ExclusionOrder Element    > Payslip Complex Type : ExclusionOrder Element  Description Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee. This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee. Namespace  Type xs:boolean Diagram   Overview ExclusionOrder optional xs:boolean  Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee. This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee.  Source <xs:element name=ExclusionOrder type=xs:boolean minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 23. This indicates that the Employer does not have to deduct Income Tax for the Employee.  This will be either ‘True’ or ‘False’. Set to “true” if an exclusion order is on file for the employee.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_765"]="Title¬PayDate Element,Content¬PayDate Element    > Payslip Complex Type : PayDate Element  Description Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ). Namespace  Type xs:date Diagram   Overview PayDate xs:date  Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ).  Source <xs:element name=PayDate type=xs:date xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 17. Date Employee is being paid (YYYY-MM-DD ).</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_766"]="Title¬GrossPay Element,Content¬GrossPay Element    > Payslip Complex Type : GrossPay Element  Description Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made. Namespace  Type defaultDecimal Simple Type Diagram   Overview GrossPay defaultDecimal Simple Type  Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made.  Source <xs:element name=GrossPay type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 24. Employee Gross Pay. Gross pay is the employee’s pay of any kind, including notional pay and share based remuneration and, before any pension contributions or salary sacrifice deductions are made.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_767"]="Title¬PayForIncomeTax Element,Content¬PayForIncomeTax Element    > Payslip Complex Type : PayForIncomeTax Element  Description Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP and approved salary sacrifice. Euro and Cent required. Namespace  Type defaultDecimal Simple Type Diagram   Overview PayForIncomeTax defaultDecimal Simple Type  Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP and approved salary sacrifice. Euro and Cent required.  Source <xs:element name=PayForIncomeTax type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 25. Pay for Income Tax. Gross pay reduced by allowable superannuation contributions, income continuance contributions, relevant reliefs such as SARP  and approved salary sacrifice.  Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_768"]="Title¬IncomeTaxPaid Element,Content¬IncomeTaxPaid Element    > Payslip Complex Type : IncomeTaxPaid Element  Description Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required. Namespace  Type defaultDecimal Simple Type Diagram   Overview IncomeTaxPaid defaultDecimal Simple Type  Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required.  Source <xs:element name=IncomeTaxPaid type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 26. Employee Tax deducted or refunded in this employment. Negative if tax refunded. Euro and Cent required.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
