s["_771"]="Title¬PRSIExempt Element,Content¬PRSIExempt Element    > Payslip Complex Type : PRSIExempt Element  Description Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland. This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland. Namespace  Type xs:boolean Diagram   Overview PRSIExempt xs:boolean  Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland. This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland.  Source <xs:element name=PRSIExempt type=xs:boolean xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 29. This field allows for the filing of returns for employees who are exempt from paying PRSI in Ireland.  This will be either ‘true’ or ‘false’. 'True' if employee is exempt from paying PRSI in Ireland.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_772"]="Title¬PRSIExemptionReason Element,Content¬PRSIExemptionReason Element    > Payslip Complex Type : PRSIExemptionReason Element  Description Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers), FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other. Namespace  Type prsiExemptionReason Simple Type Diagram   Overview PRSIExemptionReason optional prsiExemptionReason Simple Type  Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers), FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other.  Source <xs:element name=PRSIExemptionReason type=pc:prsiExemptionReason minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 30. Reason for the PRSI Exemption in Ireland. This is Mandatory if PRSI exempt. Options include A1PortableDocument (A1 Portable Document from EU Member State), CertificateOfCoverage (Certificate of coverage under Social Security Bilateral Agreement), PostedWorkerOtherNotification (Other notification of exemption for posted workers),  FamilyMember (Employment of certain family members), Under16 (Under 16 years of age), SocialWelfareScheme (Employment on certain social welfare schemes), Other.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_773"]="Title¬PRSIClassDetail Element,Content¬PRSIClassDetail Element    > Payslip Complex Type : PRSIClassDetail Element  Description PRSI Class, subclass and Insurable weeks detail. Namespace  Type PRSIClassDetail Complex Type Diagram   Overview PRSIClassDetail 0..∞ PRSIClassDetail Complex Type  PRSI Class, subclass and Insurable weeks detail. Sequence  PRSIClass prsiClass Simple Type  Data Item Ref: 31. PRSI Class and Subclass. Weeks required where class is provided. This is Mandatory if not PRSI exempt. InsurableWeeks xs:short  Data Item Ref: 32. Number of insurable weeks for each PRSI class accrued in this pay period. This is Mandatory if not PRSI exempt.    Source <xs:element name=PRSIClassDetail type=pp:PRSIClassDetail minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>PRSI Class, subclass and Insurable weeks detail.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
