s["_776"]="Title¬PayForUSC Element,Content¬PayForUSC Element    > Payslip Complex Type : PayForUSC Element  Description Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes. Namespace  Type defaultDecimal Simple Type Diagram   Overview PayForUSC defaultDecimal Simple Type  Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes.  Source <xs:element name=PayForUSC type=pc:defaultDecimal xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 35. Pay for USC. Includes notional pay and all Superannuation and Income Continuance Scheme Contributions. Excludes DSP payments, Illness Benefit and payments of a similar nature under certain approved schemes.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_777"]="Title¬USCStatus Element,Content¬USCStatus Element    > Payslip Complex Type : USCStatus Element  Description Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt. Namespace  Type uscStatus Simple Type Diagram   Overview USCStatus uscStatus Simple Type  Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt.  Source <xs:element name=USCStatus type=pc:uscStatus xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 36. USC Status. Allowed values are Ordinary and Exempt.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
