s["_779"]="Title¬LPTDeducted Element,Content¬LPTDeducted Element    > Payslip Complex Type : LPTDeducted Element  Description Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable. Namespace  Type defaultDecimal Simple Type Diagram   Overview LPTDeducted optional defaultDecimal Simple Type  Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable.  Source <xs:element name=LPTDeducted type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 50. LPT Deducted. Local Property Tax amount paid. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_780"]="Title¬GrossMedicalInsurance Element,Content¬GrossMedicalInsurance Element    > Payslip Complex Type : GrossMedicalInsurance Element  Description Data Item Ref: 38. Gross Medical Insurance paid by Employer for the Employee. This is mandatory if applicable. Namespace  Type defaultDecimal Simple Type Diagram   Overview GrossMedicalInsurance optional defaultDecimal Simple Type  Data Item Ref: 38. Gross Medical Insurance paid by Employer for the Employee. This is mandatory if applicable.  Source <xs:element name=GrossMedicalInsurance type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 38. Gross Medical Insurance paid by Employer for the Employee. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_781"]="Title¬ShareBasedRemuneration Element,Content¬ShareBasedRemuneration Element    > Payslip Complex Type : ShareBasedRemuneration Element  Description Data Item Ref: 46. This is share-based remuneration consisting of shares in the employer company or a company that controls the employer company that is included in ‘Gross Pay’. Namespace  Type defaultDecimal Simple Type Diagram   Overview ShareBasedRemuneration optional defaultDecimal Simple Type  Data Item Ref: 46. This is share-based remuneration consisting of shares in the employer company or a company that controls the employer company that is included in ‘Gross Pay’.  Source <xs:element name=ShareBasedRemuneration type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 46. This is share-based remuneration consisting of shares in the employer company or a company that controls the employer company that is included in ‘Gross Pay’.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_782"]="Title¬TaxableBenefits Element,Content¬TaxableBenefits Element    > Payslip Complex Type : TaxableBenefits Element  Description Data Item Ref: 47. Taxable value of benefits provided to the employee. This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable. Namespace  Type defaultDecimal Simple Type Diagram   Overview TaxableBenefits optional defaultDecimal Simple Type  Data Item Ref: 47. Taxable value of benefits provided to the employee. This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable.  Source <xs:element name=TaxableBenefits type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 47. Taxable value of benefits provided to the employee.   This is the amount of non-cash benefits (for example, private use of a company car, free or subsidised accommodation, preferential loans), other than company Share-based Remuneration (but including shares in companies that are not the employer company or a company that controls the employer company), that is included in ‘Gross Pay’. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_783"]="Title¬TaxableLumpSum Element,Content¬TaxableLumpSum Element    > Payslip Complex Type : TaxableLumpSum Element  Description Data Item Ref: 48. Amount of taxable lump sum payment included in ‘Pay for Income Tax’. This is mandatory if applicable. Namespace  Type defaultDecimal Simple Type Diagram   Overview TaxableLumpSum optional defaultDecimal Simple Type  Data Item Ref: 48. Amount of taxable lump sum payment included in ‘Pay for Income Tax’. This is mandatory if applicable.  Source <xs:element name=TaxableLumpSum type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 48. Amount of taxable lump sum payment included in ‘Pay for Income Tax’. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_784"]="Title¬NonTaxableLumpSum Element,Content¬NonTaxableLumpSum Element    > Payslip Complex Type : NonTaxableLumpSum Element  Description Data Item Ref: 49. Amount of lump sum payment not included in ‘Pay for Income Tax’, excluding statutory redundancy payments. This is mandatory if applicable. Namespace  Type defaultDecimal Simple Type Diagram   Overview NonTaxableLumpSum optional defaultDecimal Simple Type  Data Item Ref: 49. Amount of lump sum payment not included in ‘Pay for Income Tax’, excluding statutory redundancy payments. This is mandatory if applicable.  Source <xs:element name=NonTaxableLumpSum type=pc:defaultDecimal minOccurs=0 xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 49. Amount of lump sum payment not included in ‘Pay for Income Tax’, excluding statutory redundancy payments. This is mandatory if applicable.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
s["_785"]="Title¬PensionTracingNumber Element,Content¬PensionTracingNumber Element    > Payslip Complex Type : PensionTracingNumber Element  Description Data Item Ref: 39. Pension Tracing Number. The format of the pension tracing number is “PBXXXXXX”, where XXXXXX is a number with up to 6 digits. E.g. PB123456. This is mandatory if applicable. Should only be provided when the Employee joins a pension or changes pension. Namespace  Type pensionTracingNumber Simple Type Diagram   Overview PensionTracingNumber 0..∞ pensionTracingNumber Simple Type  Data Item Ref: 39. Pension Tracing Number. The format of the pension tracing number is “PBXXXXXX”, where XXXXXX is a number with up to 6 digits. E.g. PB123456. This is mandatory if applicable. Should only be provided when the Employee joins a pension or changes pension.  Source <xs:element name=PensionTracingNumber type=pc:pensionTracingNumber minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: 39. Pension Tracing Number. The format of the pension tracing number is “PBXXXXXX”, where XXXXXX is a number with up to 6 digits. E.g. PB123456. This is mandatory if applicable. Should only be provided when the Employee joins a pension or changes pension.</xs:documentation>   </xs:annotation> </xs:element>  See Also Payslip Complex Type |"
