s["_916"]="Title¬ERN Element,Content¬ERN Element    > LookUpERNResponse Complex Type : ERN Element  Description Data Item Ref: N/A. List of valid ERNs. Namespace  Type ERN Complex Type Diagram   Overview ERN 0..∞ ERN Complex Type  Data Item Ref: N/A. List of valid ERNs. Sequence  EmployeeID EmployeeID Complex Type  Employee's PPS Number and Employment ID (if available). Sequence  EmployeePPSN EmployeePPSN Simple Type  Employee's PPS Number. EmploymentID optional employmentID Simple Type  Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   Name optional Name Complex Type  The employee name. Sequence  FirstName defaultString Simple Type  The first name of the employee. FamilyName defaultString Simple Type  The surname/family name of the employee.   EmploymentCeased xs:boolean  Employment ceased marker.    Source <xs:element name=ERN type=pn:ERN minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: N/A. List of valid ERNs.</xs:documentation>   </xs:annotation> </xs:element>  See Also LookUpERNResponse Complex Type |"
