s["_918"]="Title¬ValidationError Element,Content¬ValidationError Element    > LookUpERNResponse Complex Type : ValidationError Element  Description Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer. Namespace  Type ErrorWithId Complex Type Diagram   Overview ValidationError 0..∞ ErrorWithId Complex Type  Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.    Source <xs:element name=ValidationError type=pn:ErrorWithId minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Data Item Ref: N/A. List of Validation errors (if any) on the Look Up ERN request. Validations are returned with an id field where a PPSN provided is invalid. The id field will not be present where PPSN processing is not reached e.g. No RPN found for the employer.</xs:documentation>   </xs:annotation> </xs:element>  See Also LookUpERNResponse Complex Type |"
