s["_923"]="Title¬CheckErrRunRequest Element,Content¬CheckErrRunRequest Element    : CheckErrRunRequest Element  Description Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the Run Reference. Namespace  Type CheckErrRunRequest Complex Type Diagram   Overview CheckErrRunRequest CheckErrRunRequest Complex Type  Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the Run Reference. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by an agent on behalf of employer. TaxYear taxYear Simple Type  Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.   EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Used to identify the Enhanced Reporting event for which the submission refers.    Source <xs:element name=CheckErrRunRequest type=pp:CheckErrRunRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the Run Reference.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_924"]="Title¬CheckErrRunResponse Element,Content¬CheckErrRunResponse Element    : CheckErrRunResponse Element  Description Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions. Namespace  Type CheckErrRunResponse Complex Type Diagram   Overview CheckErrRunResponse CheckErrRunResponse Complex Type  Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions. Sequence  Status runProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the run are at a status of Pending. Amount optional xs:decimal  Data Item Ref: N/A. Total amount across valid line items for the Enhanced Reporting Run. Included when all submissions received for the run have been processed. ExpenseBenefitSubmissions 0..∞ ExpenseBenefitSubmissionStatus Complex Type  High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique ID of the Enhanced Reporting Submission. Status submissionProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed. ExpenseBenefitSubmissionSummary optional ExpenseBenefitSubmissionSummary Complex Type  Summary details of Expense Submission. Included when submission has completed processing. Sequence  Amount xs:decimal  Data Item Ref: N/A. Total amount across valid line items on submission. ExpensesBenefitsCount xs:unsignedInt  Data Item Ref: N/A. Total number of line items included on submission. ExpensesBenefitsToDeleteCount xs:unsignedInt  Total number of Expense Benefit line item IDs for deletion included on submission.     ExpenseBenefitSummary 0..∞ ExpenseBenefitSummary Complex Type  Summary details of individual Expense Benefits that make up the Expense Benefit Run. Sequence  LineItemID expenseBenefitLineItemID Simple Type  Data Item Ref: 5. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Data Item Refs: 9 and 15. Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 14. Employee's internal staff identifier/reference. This will be mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Category category Simple Type  Data Item Ref: 18. Category of Expense Benefit. Possible values are Travel and Subsistence, Remote Working Daily Allowance, Small Benefits Exemption. SubCategory optional subcategory Simple Type  Data Item Ref: 19. Subcategory of Expense Benefit. Will be mandatory if relevant category is selected. Possible values for Travel and Subsistence category are Travel Vouched, Travel Unvouched, Subsistence Vouched, Subsistence Unvouched, Site Based Employees, Emergency Travel, Eating on Site, Advance Payment. Amount xs:decimal  Data Item Ref: 17. Total amount for this Expense Benefit on submission.   ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckErrRunRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Source <xs:element name=CheckErrRunResponse type=pp:CheckErrRunResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_925"]="Title¬CheckErrSubmissionRequest Element,Content¬CheckErrSubmissionRequest Element    : CheckErrSubmissionRequest Element  Description Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID. Namespace  Type CheckErrSubmissionRequest Complex Type Diagram   Overview CheckErrSubmissionRequest CheckErrSubmissionRequest Complex Type  Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission filed by agent on behalf of employer. TaxYear taxYear Simple Type  Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.   EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Used to identify the Enhanced Reporting event to which the submission refers. SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions.    Source <xs:element name=CheckErrSubmissionRequest type=pp:CheckErrSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_926"]="Title¬CheckErrSubmissionResponse Element,Content¬CheckErrSubmissionResponse Element    : CheckErrSubmissionResponse Element  Description Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items. Namespace  Type CheckErrSubmissionResponse Complex Type Diagram   Overview CheckErrSubmissionResponse CheckErrSubmissionResponse Complex Type  Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions. Status submissionProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed. SubmissionHeader SubmissionHeader Complex Type  Header elements that were included in submission that is being checked. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by agent on behalf of employer. EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Enhanced Reporting Run Reference. Used to identify the event to which the submission refers. TaxYear taxYear Simple Type  Data Item Ref: 6. Tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.     ExpenseBenefitSubmissionSummary optional ExpenseBenefitSubmissionSummary Complex Type  Summary totals for Expense Benefit Submission. Included when submission has completed processing. Sequence  Amount xs:decimal  Data Item Ref: N/A. Total amount across valid line items on submission. ExpensesBenefitsCount xs:unsignedInt  Data Item Ref: N/A. Total number of line items included on submission. ExpensesBenefitsToDeleteCount xs:unsignedInt  Total number of Expense Benefit line item IDs for deletion included on submission.   InvalidExpenseBenefit 0..∞ InvalidExpenseBenefit Complex Type  List of Invalid Expense Benefits (if any). Any in this list will not have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation errors. Error 1..∞ Error Complex Type  List of validation errors related to the Expense Benefit. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.     WarningExpenseBenefit 0..∞ WarningExpenseBenefit Complex Type  List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation warnings. Warning 1..∞ Warning Complex Type  List of validation warnings related to the Expense Benefit. Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.     ValidationError 0..∞ ErrorWithId Complex Type  List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.      Source <xs:element name=CheckErrSubmissionResponse type=pp:CheckErrSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_927"]="Title¬EnhancedReportingSubmissionRequest Element,Content¬EnhancedReportingSubmissionRequest Element    : EnhancedReportingSubmissionRequest Element  Description Employer's PAYE Enhanced Reporting Submission Request. Namespace  Type EnhancedReportingSubmissionRequest Complex Type Diagram   Overview EnhancedReportingSubmissionRequest EnhancedReportingSubmissionRequest Complex Type  Employer's PAYE Enhanced Reporting Submission Request. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. Header SubmissionHeader Complex Type  Required header level elements for a submission. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by agent on behalf of employer. EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Enhanced Reporting Run Reference. Used to identify the event to which the submission refers. TaxYear taxYear Simple Type  Data Item Ref: 6. Tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.     ExpensesBenefits 0..∞ ExpenseBenefit Complex Type  List of Expense Benefits that make up the Employer Enhanced Reporting Submission. Sequence  LineItemID expenseBenefitLineItemID Simple Type  Data Item Ref: 5. Used to uniquely identify individual line items. PreviousLineItemID optional expenseBenefitLineItemID Simple Type  Data Item Ref: N/A. Used to identify a previous version of this line item when corrections are made. Can only reference line items within the same Enhanced Reporting Run. EmployeeID optional EmployeeID Complex Type  Data Item Refs: 9 and 15. Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 14. Employee's internal staff identifier/reference. This will be mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Name Name Complex Type  Data Item Ref: 10 and 11. Employee Name. Mandatory. Sequence  FirstName defaultString Simple Type  Data Item Ref: 10. The first name of the employee. FamilyName defaultString Simple Type  Data Item Ref: 11. The surname/family name of the employee.   Address optional Address Complex Type  Data Item Ref: 12. Elements required when Employee PPSN is not known. Sequence  AddressLine 1..3 defaultString Simple Type  Data Item Ref: 12. The address will be mandatory if the PPSN isn’t available. Line 1 of the employee's address is required. County optional county Simple Type  Data Item Ref: 12. County element of the employee's address. Eircode optional eircode Simple Type  Data Item Ref: 12. Employee's Eircode (if known). Used for Irish addresses only. CountryCode optional countryCode Simple Type  Data Item Ref: 12. Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.   DateOfBirth optional xs:date  Data Item Ref: 13. Employee's Date of Birth - format YYYY-MM-DD. This will be mandatory if the PPSN isn’t available. Category category Simple Type  Data Item Ref: 18. Category of Expense Benefit. Possible values are Travel and Subsistence, Remote Working Daily Allowance, Small Benefits Exemption. SubCategory optional subcategory Simple Type  Data Item Ref: 19. Subcategory of Expense Benefit. Will be mandatory if relevant category is selected. Possible values for Travel and Subsistence category are Travel Vouched, Travel Unvouched, Subsistence Vouched, Subsistence Unvouched, Site Based Employees, Emergency Travel, Eating on Site, Advance Payment. AdvancePaymentReconciliation optional xs:boolean  Data Item Ref: 21. Advance Payment Reconciliation. This is to identify if a Travel and Subsistence submission relates to a previously submitted Advance Payment. PaymentDate xs:date  Data Item Ref: 16. Date employee is paid Expense Benefit (YYYY-MM-DD). NumberOfDays optional xs:integer  Data Item Ref: 20. Number of Days. The total number of days for the Expense Benefit. Amount defaultDecimal Simple Type  Data Item Ref: 17. Expense Benefit Amount. The total amount of the Expense Benefit.   LineItemIDToDelete 0..∞ expenseBenefitLineItemID Simple Type  For correction submissions, this should include any line item IDs across the run to be deleted.    Source <xs:element name=EnhancedReportingSubmissionRequest type=pp:EnhancedReportingSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Employer's PAYE Enhanced Reporting Submission Request.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_928"]="Title¬EnhancedReportingSubmissionResponse Element,Content¬EnhancedReportingSubmissionResponse Element    : EnhancedReportingSubmissionResponse Element  Description Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed. Namespace  Type EnhancedReportingSubmissionResponse Complex Type Diagram   Overview EnhancedReportingSubmissionResponse EnhancedReportingSubmissionResponse Complex Type  Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed. Sequence  AcknowledgementStatus statusAcknowledgement Simple Type  Acknowledgement status for Employer's PAYE Enhanced Reporting Submission Request. Possible values are Acknowledged or Rejected. AcknowledgementID optional acknowledgementID Simple Type  Unique ID for acknowledged requests - to be used for technical support if required. ValidationError 0..∞ Error Complex Type  List of Submission Validation Errors (if any). Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.   ValidationWarning 0..∞ Warning Complex Type  List of Submission Validation Warnings (if any). Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.      Source <xs:element name=EnhancedReportingSubmissionResponse type=pp:EnhancedReportingSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_929"]="Title¬MonthlyErrReportRequest Element,Content¬MonthlyErrReportRequest Element    : MonthlyErrReportRequest Element  Description Request to get a monthly report of an Employer's PAYE Enhanced Reporting submissions. Namespace  Type MonthlyErrReportRequest Complex Type Diagram   Overview MonthlyErrReportRequest MonthlyErrReportRequest Complex Type  Request to get a monthly report of an Employer's PAYE Enhanced Reporting submissions. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 301. Employer's PAYE Registration Number. Used to identify employer to which the period details relate. AgentTain optional agentTAIN Simple Type  Data Item Ref: 302. Used to identify the agent requesting on behalf of the employer and to ensure that an agent link exists for this employer agent relationship for the period that the request relates to. TaxYear taxYear Simple Type  Data Item Ref: 305. Tax year that the expenses/benefits report is being requested for. Month month Simple Type  Data Item Ref: 306. Month to process for report breakdown. SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 303 and 304. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.      Source <xs:element name=MonthlyErrReportRequest type=pp:MonthlyErrReportRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to get a monthly report of an Employer's PAYE Enhanced Reporting submissions.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_930"]="Title¬MonthlyErrReportResponse Element,Content¬MonthlyErrReportResponse Element    : MonthlyErrReportResponse Element  Description Return the monthly report of an Employer's PAYE Enhanced Reporting submissions. Namespace  Type MonthlyErrReportResponse Complex Type Diagram   Overview MonthlyErrReportResponse MonthlyErrReportResponse Complex Type  Return the monthly report of an Employer's PAYE Enhanced Reporting submissions. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 307. Employer's PAYE Registration Number. Used to identify employer to which the period details relate. AgentTain optional agentTAIN Simple Type  Data Item Ref: 308. Used to identify the agent requesting on behalf of the employer and to ensure that an agent link exists for this employer agent relationship for the period that the request relates to. TaxYear taxYear Simple Type  Data Item Ref: 309. Tax year that the expenses/benefits report is being requested for. Month month Simple Type  Data Item Ref: 310. Month to process for report breakdown. DateTimeEffective xs:dateTime  Data Item Ref: N/A. The date and time the report was requested. NumberOfExpensesBenefits xs:integer  Data Item Ref: 311. The number of expenses/benefits accounted for in the requested report. TotalAmount xs:decimal  Data Item Ref: 312. The overall total expenses/benefits reported for the requested month. (Only expense/benefit figures with pay dates in the selected month are included in this total). CategoryBreakdown 0..∞ CategoryBreakdown Complex Type  List of category breakdowns containing the submission totals by category for the given month. Sequence  CategoryType category Simple Type  Data Item Ref: 313. Identifies the category. TotalAmount xs:decimal  Data Item Ref: 314. The total expenses/benefits reported for that category in the requested month. SubCategoryBreakdown 0..∞ SubCategoryBreakdown Complex Type  List of sub-category breakdowns containing the submission totals. Sequence  SubCategoryType subcategory Simple Type  Data Item Ref: 315. Identifies the sub category if applicable. TotalAmount xs:decimal  Data Item Ref: 316. The total expenses/benefits reported for that sub category in the requested month.     RunReferenceBreakdown 0..∞ RunReferenceBreakdown Complex Type  List of run reference breakdowns containing the run total for the given month and the date the run was last updated. Sequence  RunReference defaultString Simple Type  Data Item Ref: 317. The reference number identifies a specific ERR run. SubmissionDate xs:date  Data Item Ref: 318. The date the ERR run was submitted/last updated. This date may relate to a submission outside of the month provided. TotalAmount xs:decimal  Data Item Ref: 319. The total expenses/benefits reported in the ERR Run with pay dates in the requested month.      Source <xs:element name=MonthlyErrReportResponse type=pp:MonthlyErrReportResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the monthly report of an Employer's PAYE Enhanced Reporting submissions.</xs:documentation>   </xs:annotation> </xs:element>  See Also"
s["_931"]="Title¬Address Complex Type,Content¬Address Complex Type    : Address Complex Type  Description The address of the employee. This will be mandatory if the PPSN isn’t available. Namespace  Diagram   Overview Address  The address of the employee. This will be mandatory if the PPSN isn’t available. Sequence  AddressLine 1..3 defaultString Simple Type  Data Item Ref: 12. The address will be mandatory if the PPSN isn’t available. Line 1 of the employee's address is required. County optional county Simple Type  Data Item Ref: 12. County element of the employee's address. Eircode optional eircode Simple Type  Data Item Ref: 12. Employee's Eircode (if known). Used for Irish addresses only. CountryCode optional countryCode Simple Type  Data Item Ref: 12. Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.    Used By Address Element  Source <xs:complexType name=Address xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>The address of the employee. This will be mandatory if the PPSN isn’t available.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=AddressLine type=pc:defaultString maxOccurs=3>       <xs:annotation>         <xs:documentation>Data Item Ref: 12. The address will be mandatory if the PPSN isn’t available. Line 1 of the employee's address is required.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=County type=pc:county minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 12. County element of the employee's address.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Eircode type=pc:eircode minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 12. Employee's Eircode (if known). Used for Irish addresses only.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=CountryCode type=pc:countryCode minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 12. Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_932"]="Title¬CategoryBreakdown Complex Type,Content¬CategoryBreakdown Complex Type    : CategoryBreakdown Complex Type  Description Category breakdown information. Namespace  Diagram   Overview CategoryBreakdown  Category breakdown information. Sequence  CategoryType category Simple Type  Data Item Ref: 313. Identifies the category. TotalAmount xs:decimal  Data Item Ref: 314. The total expenses/benefits reported for that category in the requested month. SubCategoryBreakdown 0..∞ SubCategoryBreakdown Complex Type  List of sub-category breakdowns containing the submission totals. Sequence  SubCategoryType subcategory Simple Type  Data Item Ref: 315. Identifies the sub category if applicable. TotalAmount xs:decimal  Data Item Ref: 316. The total expenses/benefits reported for that sub category in the requested month.      Used By CategoryBreakdown Element  Source <xs:complexType name=CategoryBreakdown xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Category breakdown information.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=CategoryType type=pc:category>       <xs:annotation>         <xs:documentation>Data Item Ref: 313. Identifies the category.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TotalAmount type=xs:decimal>       <xs:annotation>         <xs:documentation>Data Item Ref: 314. The total expenses/benefits reported for that category in the requested month.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubCategoryBreakdown type=pp:SubCategoryBreakdown minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of sub-category breakdowns containing the submission totals.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_933"]="Title¬CheckErrRunRequest Complex Type,Content¬CheckErrRunRequest Complex Type    : CheckErrRunRequest Complex Type  Description Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the RunReference. Namespace  Diagram   Overview CheckErrRunRequest  Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the RunReference. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by an agent on behalf of employer. TaxYear taxYear Simple Type  Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.   EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Used to identify the Enhanced Reporting event for which the submission refers.    Used By CheckErrRunRequest Element ()  Source <xs:complexType name=CheckErrRunRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Enhanced Reporting Run, based on the RunReference.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployerRegistrationNumber type=pc:employerReg>       <xs:annotation>         <xs:documentation>Data Item Ref: 1. Employer's PAYE Registration Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AgentTain type=pc:agentTAIN minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by an agent on behalf of employer.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxYear type=pc:taxYear>       <xs:annotation>         <xs:documentation>Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SoftwareUsed type=pp:SoftwareUsed>       <xs:annotation>         <xs:documentation>Data Item Refs: 7 and 8. Third party software product identifier.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=EnhancedReportingRunReference type=pc:enhancedReportingRunReference>       <xs:annotation>         <xs:documentation>Data Item Ref: 4. Used to identify the Enhanced Reporting event for which the submission refers.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_934"]="Title¬CheckErrRunResponse Complex Type,Content¬CheckErrRunResponse Complex Type    : CheckErrRunResponse Complex Type  Description Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions. Namespace  Diagram   Overview CheckErrRunResponse  Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions. Sequence  Status runProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the run are at a status of Pending. Amount optional xs:decimal  Data Item Ref: N/A. Total amount across valid line items for the Enhanced Reporting Run. Included when all submissions received for the run have been processed. ExpenseBenefitSubmissions 0..∞ ExpenseBenefitSubmissionStatus Complex Type  High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique ID of the Enhanced Reporting Submission. Status submissionProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed. ExpenseBenefitSubmissionSummary optional ExpenseBenefitSubmissionSummary Complex Type  Summary details of Expense Submission. Included when submission has completed processing. Sequence  Amount xs:decimal  Data Item Ref: N/A. Total amount across valid line items on submission. ExpensesBenefitsCount xs:unsignedInt  Data Item Ref: N/A. Total number of line items included on submission. ExpensesBenefitsToDeleteCount xs:unsignedInt  Total number of Expense Benefit line item IDs for deletion included on submission.     ExpenseBenefitSummary 0..∞ ExpenseBenefitSummary Complex Type  Summary details of individual Expense Benefits that make up the Expense Benefit Run. Sequence  LineItemID expenseBenefitLineItemID Simple Type  Data Item Ref: 5. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Data Item Refs: 9 and 15. Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 14. Employee's internal staff identifier/reference. This will be mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Category category Simple Type  Data Item Ref: 18. Category of Expense Benefit. Possible values are Travel and Subsistence, Remote Working Daily Allowance, Small Benefits Exemption. SubCategory optional subcategory Simple Type  Data Item Ref: 19. Subcategory of Expense Benefit. Will be mandatory if relevant category is selected. Possible values for Travel and Subsistence category are Travel Vouched, Travel Unvouched, Subsistence Vouched, Subsistence Unvouched, Site Based Employees, Emergency Travel, Eating on Site, Advance Payment. Amount xs:decimal  Data Item Ref: 17. Total amount for this Expense Benefit on submission.   ValidationError 0..∞ Error Complex Type  List of Errors (if any) on the CheckErrRunRequest. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.      Used By CheckErrRunResponse Element ()  Source <xs:complexType name=CheckErrRunResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Enhanced Reporting Run. Includes list of submissions that make up the run and includes summary details of processed submissions.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=Status type=pc:runProcessingStatus>       <xs:annotation>         <xs:documentation>Data Item Ref: N/A. Current Status of Enhanced Reporting Run. Possible values are Pending or Processed. Will be marked as Pending if any submissions making up the run are at a status of Pending.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Amount type=xs:decimal minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: N/A. Total amount across valid line items for the Enhanced Reporting Run. Included when all submissions received for the run have been processed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ExpenseBenefitSubmissions type=pp:ExpenseBenefitSubmissionStatus minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ExpenseBenefitSummary type=pp:ExpenseBenefitSummary minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>Summary details of individual Expense Benefits that make up the Expense Benefit Run.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationError type=pp:Error minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Errors (if any) on the CheckErrRunRequest.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_935"]="Title¬CheckErrSubmissionRequest Complex Type,Content¬CheckErrSubmissionRequest Complex Type    : CheckErrSubmissionRequest Complex Type  Description Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID. Namespace  Diagram   Overview CheckErrSubmissionRequest  Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission filed by agent on behalf of employer. TaxYear taxYear Simple Type  Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.   EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Used to identify the Enhanced Reporting event to which the submission refers. SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions.    Used By CheckErrSubmissionRequest Element ()  Source <xs:complexType name=CheckErrSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Request to check the current status of an Employer's PAYE Enhanced Reporting Submission, based on the Submission ID.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployerRegistrationNumber type=pc:employerReg>       <xs:annotation>         <xs:documentation>Data Item Ref: 1. Employer's PAYE Registration Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AgentTain type=pc:agentTAIN minOccurs=0>       <xs:annotation>         <xs:documentation>Data Item Ref: 2. Tax Advisor Identification Number. Required if submission filed by agent on behalf of employer.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=TaxYear type=pc:taxYear>       <xs:annotation>         <xs:documentation>Data Item Ref: 6. Used to identify the tax year to which the submission relates (YYYY).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SoftwareUsed type=pp:SoftwareUsed>       <xs:annotation>         <xs:documentation>Data Item Refs: 7 and 8. Third party software product identifier.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=EnhancedReportingRunReference type=pc:enhancedReportingRunReference>       <xs:annotation>         <xs:documentation>Data Item Ref: 4. Used to identify the Enhanced Reporting event to which the submission refers.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_936"]="Title¬CheckErrSubmissionResponse Complex Type,Content¬CheckErrSubmissionResponse Complex Type    : CheckErrSubmissionResponse Complex Type  Description Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items. Namespace  Diagram   Overview CheckErrSubmissionResponse  Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions. Status submissionProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed. SubmissionHeader SubmissionHeader Complex Type  Header elements that were included in submission that is being checked. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by agent on behalf of employer. EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Enhanced Reporting Run Reference. Used to identify the event to which the submission refers. TaxYear taxYear Simple Type  Data Item Ref: 6. Tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.     ExpenseBenefitSubmissionSummary optional ExpenseBenefitSubmissionSummary Complex Type  Summary totals for Expense Benefit Submission. Included when submission has completed processing. Sequence  Amount xs:decimal  Data Item Ref: N/A. Total amount across valid line items on submission. ExpensesBenefitsCount xs:unsignedInt  Data Item Ref: N/A. Total number of line items included on submission. ExpensesBenefitsToDeleteCount xs:unsignedInt  Total number of Expense Benefit line item IDs for deletion included on submission.   InvalidExpenseBenefit 0..∞ InvalidExpenseBenefit Complex Type  List of Invalid Expense Benefits (if any). Any in this list will not have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation errors. Error 1..∞ Error Complex Type  List of validation errors related to the Expense Benefit. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.     WarningExpenseBenefit 0..∞ WarningExpenseBenefit Complex Type  List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved. Sequence  LineItemID expenseBenefitLineItemID Simple Type  LineItemID of the Expense Benefit containing validation warnings. Warning 1..∞ Warning Complex Type  List of validation warnings related to the Expense Benefit. Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.     ValidationError 0..∞ ErrorWithId Complex Type  List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.      Used By CheckErrSubmissionResponse Element ()  Source <xs:complexType name=CheckErrSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Return the current status of an Employer's PAYE Enhanced Reporting Submission. If processed, includes summary totals of valid data items and validation errors for invalid data items.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Data Item Ref: 3. Unique Submission ID of the Employer Enhanced Reporting Submission. Used to identify individual submissions.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Status type=pc:submissionProcessingStatus>       <xs:annotation>         <xs:documentation>Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=SubmissionHeader type=pp:SubmissionHeader>       <xs:annotation>         <xs:documentation>Header elements that were included in submission that is being checked.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ExpenseBenefitSubmissionSummary type=pp:ExpenseBenefitSubmissionSummary minOccurs=0>       <xs:annotation>         <xs:documentation>Summary totals for Expense Benefit Submission. Included when submission has completed processing.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=InvalidExpenseBenefit type=pp:InvalidExpenseBenefit minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Invalid Expense Benefits (if any). Any in this list will not have been saved.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=WarningExpenseBenefit type=pp:WarningExpenseBenefit minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Expense Benefit Warnings (if any) associated with Valid submission. Any in this list will have been saved.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationError type=pp:ErrorWithId minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_937"]="Title¬EmployeeID Complex Type,Content¬EmployeeID Complex Type    : EmployeeID Complex Type  Description Unique references to an employment for an employee. Includes PPSN and Employment ID. Namespace  Diagram   Overview EmployeeID  Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.    Used By EmployeeID Element  EmployeeID Element  Source <xs:complexType name=EmployeeID xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Unique references to an employment for an employee. Includes PPSN and Employment ID.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=EmployeePPSN type=pc:EmployeePPSN>       <xs:annotation>         <xs:documentation>Data Item Ref: 9. Employee's PPS Number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=EmploymentID type=pc:employmentID>       <xs:annotation>         <xs:documentation>Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_938"]="Title¬EnhancedReportingSubmissionRequest Complex Type,Content¬EnhancedReportingSubmissionRequest Complex Type    : EnhancedReportingSubmissionRequest Complex Type  Description Employer's PAYE Enhanced Reporting Submission Request. Namespace  Diagram   Overview EnhancedReportingSubmissionRequest  Employer's PAYE Enhanced Reporting Submission Request. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number. Header SubmissionHeader Complex Type  Required header level elements for a submission. Sequence  EmployerRegistrationNumber employerReg Simple Type  Data Item Ref: 1. Employer's PAYE Registration Number. AgentTain optional agentTAIN Simple Type  Data Item Ref: 2. Tax Advisor Identification Number. Required if submission is filed by agent on behalf of employer. EnhancedReportingRunReference enhancedReportingRunReference Simple Type  Data Item Ref: 4. Enhanced Reporting Run Reference. Used to identify the event to which the submission refers. TaxYear taxYear Simple Type  Data Item Ref: 6. Tax year to which the submission relates (YYYY). SoftwareUsed SoftwareUsed Complex Type  Data Item Refs: 7 and 8. Third party software product identifier. Sequence  Name NonEmptyString Simple Type  Data Item Ref: 7. Name of third party software product. Version NonEmptyString Simple Type  Data Item Ref: 8. Version of third party software product.     ExpensesBenefits 0..∞ ExpenseBenefit Complex Type  List of Expense Benefits that make up the Employer Enhanced Reporting Submission. Sequence  LineItemID expenseBenefitLineItemID Simple Type  Data Item Ref: 5. Used to uniquely identify individual line items. PreviousLineItemID optional expenseBenefitLineItemID Simple Type  Data Item Ref: N/A. Used to identify a previous version of this line item when corrections are made. Can only reference line items within the same Enhanced Reporting Run. EmployeeID optional EmployeeID Complex Type  Data Item Refs: 9 and 15. Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 14. Employee's internal staff identifier/reference. This will be mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Name Name Complex Type  Data Item Ref: 10 and 11. Employee Name. Mandatory. Sequence  FirstName defaultString Simple Type  Data Item Ref: 10. The first name of the employee. FamilyName defaultString Simple Type  Data Item Ref: 11. The surname/family name of the employee.   Address optional Address Complex Type  Data Item Ref: 12. Elements required when Employee PPSN is not known. Sequence  AddressLine 1..3 defaultString Simple Type  Data Item Ref: 12. The address will be mandatory if the PPSN isn’t available. Line 1 of the employee's address is required. County optional county Simple Type  Data Item Ref: 12. County element of the employee's address. Eircode optional eircode Simple Type  Data Item Ref: 12. Employee's Eircode (if known). Used for Irish addresses only. CountryCode optional countryCode Simple Type  Data Item Ref: 12. Country code element. Codes used at the International Standard for country codes ISO 3166 Alpha-3.   DateOfBirth optional xs:date  Data Item Ref: 13. Employee's Date of Birth - format YYYY-MM-DD. This will be mandatory if the PPSN isn’t available. Category category Simple Type  Data Item Ref: 18. Category of Expense Benefit. Possible values are Travel and Subsistence, Remote Working Daily Allowance, Small Benefits Exemption. SubCategory optional subcategory Simple Type  Data Item Ref: 19. Subcategory of Expense Benefit. Will be mandatory if relevant category is selected. Possible values for Travel and Subsistence category are Travel Vouched, Travel Unvouched, Subsistence Vouched, Subsistence Unvouched, Site Based Employees, Emergency Travel, Eating on Site, Advance Payment. AdvancePaymentReconciliation optional xs:boolean  Data Item Ref: 21. Advance Payment Reconciliation. This is to identify if a Travel and Subsistence submission relates to a previously submitted Advance Payment. PaymentDate xs:date  Data Item Ref: 16. Date employee is paid Expense Benefit (YYYY-MM-DD). NumberOfDays optional xs:integer  Data Item Ref: 20. Number of Days. The total number of days for the Expense Benefit. Amount defaultDecimal Simple Type  Data Item Ref: 17. Expense Benefit Amount. The total amount of the Expense Benefit.   LineItemIDToDelete 0..∞ expenseBenefitLineItemID Simple Type  For correction submissions, this should include any line item IDs across the run to be deleted.    Used By EnhancedReportingSubmissionRequest Element ()  Source <xs:complexType name=EnhancedReportingSubmissionRequest xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Employer's PAYE Enhanced Reporting Submission Request.</xs:documentation>   </xs:annotation>   <xs:sequence>     <!-- Header Elements -->     <xs:element name=SubmissionID type=pc:submissionID>       <xs:annotation>         <xs:documentation>Data Item Ref: 3. Unique submission identifier. Must be unique for submissions under a given employer's PAYE registration number.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=Header type=pp:SubmissionHeader>       <xs:annotation>         <xs:documentation>Required header level elements for a submission.</xs:documentation>       </xs:annotation>     </xs:element>     <!-- Expense Benefit Line Item Elements -->     <xs:element name=ExpensesBenefits type=pp:ExpenseBenefit minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Expense Benefits that make up the Employer Enhanced Reporting Submission.</xs:documentation>       </xs:annotation>     </xs:element>     <!-- Expense Benefit Deletion Line Item Elements -->     <xs:element name=LineItemIDToDelete type=pc:expenseBenefitLineItemID minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>For correction submissions, this should include any line item IDs across the run to be deleted.</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
s["_939"]="Title¬EnhancedReportingSubmissionResponse Complex Type,Content¬EnhancedReportingSubmissionResponse Complex Type    : EnhancedReportingSubmissionResponse Complex Type  Description Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed. Namespace  Diagram   Overview EnhancedReportingSubmissionResponse  Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed. Sequence  AcknowledgementStatus statusAcknowledgement Simple Type  Acknowledgement status for Employer's PAYE Enhanced Reporting Submission Request. Possible values are Acknowledged or Rejected. AcknowledgementID optional acknowledgementID Simple Type  Unique ID for acknowledged requests - to be used for technical support if required. ValidationError 0..∞ Error Complex Type  List of Submission Validation Errors (if any). Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Technical description of error.   ValidationWarning 0..∞ Warning Complex Type  List of Submission Validation Warnings (if any). Sequence  Code warningCode Simple Type  Technical Code for warning - to be used for mapping to warning messages. Path optional warningPath Simple Type  Path to warning in schema, if available. Description warningDescription Simple Type  Technical description of warning.      Used By EnhancedReportingSubmissionResponse Element ()  Source <xs:complexType name=EnhancedReportingSubmissionResponse xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Acknowledges the receipt of an Employer's PAYE Enhanced Reporting Submission Request, or Validation Errors if validation failed.</xs:documentation>   </xs:annotation>   <xs:sequence>     <xs:element name=AcknowledgementStatus type=pc:statusAcknowledgement>       <xs:annotation>         <xs:documentation>Acknowledgement status for Employer's PAYE Enhanced Reporting Submission Request. Possible values are Acknowledged or Rejected.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=AcknowledgementID type=pc:acknowledgementID minOccurs=0>       <xs:annotation>         <xs:documentation>Unique ID for acknowledged requests - to be used for technical support if required.</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationError type=pp:Error minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Submission Validation Errors (if any).</xs:documentation>       </xs:annotation>     </xs:element>     <xs:element name=ValidationWarning type=pp:Warning minOccurs=0 maxOccurs=unbounded>       <xs:annotation>         <xs:documentation>List of Submission Validation Warnings (if any).</xs:documentation>       </xs:annotation>     </xs:element>   </xs:sequence> </xs:complexType>  See Also"
