s["_970"]="Title¬ExpenseBenefitSubmissions Element,Content¬ExpenseBenefitSubmissions Element    > CheckErrRunResponse Complex Type : ExpenseBenefitSubmissions Element  Description High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run. Namespace  Type ExpenseBenefitSubmissionStatus Complex Type Diagram   Overview ExpenseBenefitSubmissions 0..∞ ExpenseBenefitSubmissionStatus Complex Type  High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run. Sequence  SubmissionID submissionID Simple Type  Data Item Ref: 3. Unique ID of the Enhanced Reporting Submission. Status submissionProcessingStatus Simple Type  Data Item Ref: N/A. Current Status of Enhanced Reporting Submission. Possible values are Pending or Completed. ExpenseBenefitSubmissionSummary optional ExpenseBenefitSubmissionSummary Complex Type  Summary details of Expense Submission. Included when submission has completed processing. Sequence  Amount xs:decimal  Data Item Ref: N/A. Total amount across valid line items on submission. ExpensesBenefitsCount xs:unsignedInt  Data Item Ref: N/A. Total number of line items included on submission. ExpensesBenefitsToDeleteCount xs:unsignedInt  Total number of Expense Benefit line item IDs for deletion included on submission.      Source <xs:element name=ExpenseBenefitSubmissions type=pp:ExpenseBenefitSubmissionStatus minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>High Level details of the Expense Benefit Submissions that make up the Expense Benefit Run.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrRunResponse Complex Type |"
s["_971"]="Title¬ExpenseBenefitSummary Element,Content¬ExpenseBenefitSummary Element    > CheckErrRunResponse Complex Type : ExpenseBenefitSummary Element  Description Summary details of individual Expense Benefits that make up the Expense Benefit Run. Namespace  Type ExpenseBenefitSummary Complex Type Diagram   Overview ExpenseBenefitSummary 0..∞ ExpenseBenefitSummary Complex Type  Summary details of individual Expense Benefits that make up the Expense Benefit Run. Sequence  LineItemID expenseBenefitLineItemID Simple Type  Data Item Ref: 5. Used to uniquely identify individual line items. EmployeeID optional EmployeeID Complex Type  Data Item Refs: 9 and 15. Unique references to an employment for an employee. Includes PPSN and Employment ID. Sequence  EmployeePPSN EmployeePPSN Simple Type  Data Item Ref: 9. Employee's PPS Number. EmploymentID employmentID Simple Type  Data Item Ref: 15. Employment ID. Unique identifier for each distinct employment for an employee. To be set by the employer.   EmployerReference optional employerReference Simple Type  Data Item Ref: 14. Employee's internal staff identifier/reference. This will be mandatory if the PPSN isn’t available and must remain unchanged in all submissions received until the PPSN is available. Optional if PPSN is available. Category category Simple Type  Data Item Ref: 18. Category of Expense Benefit. Possible values are Travel and Subsistence, Remote Working Daily Allowance, Small Benefits Exemption. SubCategory optional subcategory Simple Type  Data Item Ref: 19. Subcategory of Expense Benefit. Will be mandatory if relevant category is selected. Possible values for Travel and Subsistence category are Travel Vouched, Travel Unvouched, Subsistence Vouched, Subsistence Unvouched, Site Based Employees, Emergency Travel, Eating on Site, Advance Payment. Amount xs:decimal  Data Item Ref: 17. Total amount for this Expense Benefit on submission.    Source <xs:element name=ExpenseBenefitSummary type=pp:ExpenseBenefitSummary minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>Summary details of individual Expense Benefits that make up the Expense Benefit Run.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrRunResponse Complex Type |"
