s["_985"]="Title¬ValidationError Element,Content¬ValidationError Element    > CheckErrSubmissionResponse Complex Type : ValidationError Element  Description List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Namespace  Type ErrorWithId Complex Type Diagram   Overview ValidationError 0..∞ ErrorWithId Complex Type  List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified. Sequence  Code errorCode Simple Type  Technical Error Code - to be used for mapping to error messages. Path optional errorPath Simple Type  Path to error in schema, if available. Description errorDescription Simple Type  Description of error - to be used for support. Id errorId Simple Type  Optional ID for error - to be used when multiple customers are validated.    Source <xs:element name=ValidationError type=pp:ErrorWithId minOccurs=0 maxOccurs=unbounded xmlns:xs=http://www.w3.org/2001/XMLSchema>   <xs:annotation>     <xs:documentation>List of Errors (if any) on the CheckErrSubmissionRequest. Validations are returned with an id field where a lineItem deletion validation error has occurred and the lineItem needs to be specified.</xs:documentation>   </xs:annotation> </xs:element>  See Also CheckErrSubmissionResponse Complex Type |"
